INSERT INTO `dokumen` VALUES (193,'UNAIR NEWS – Universitas Airlangga menjadi tuan rumah penyelenggaraan kongres Perhimpunan Auditor Halal Indonesia (PAHI) yang pertama. Menjadi sebuah kebanggaan tersendiri sebagai universitas negeri, kongres PAHI itu dilaksamakan di kampus UNAIR dan dihadiri oleh lebih dari 40 peserta, baik dari kalangan akademisi perguruan tinggi negeri (PTN) maupun Perguruan Tinggi Keagamaan Islam Negeri (PTKIN). Kongres diselenggarakan di Aula Kahuripan 301 Kantor Manajemen UNAIR, Sabtu (30/3/2019). Kongres bertema ‘Asosiasi Auditor Halal Memperkuat Implementasi Jaminan Produk Halal di Indonesia’ tersebut dilaksanakan untuk membentuk formatur Kongres PAHI 2019. Luaran kongres diharapkan dapat menjadi salah satu komponen pendukung dibentuknya kurikulum halal. Kegiatan yang diselenggarakan oleh Pusat Kajian Halal UNAIR tersebut terdiri dari tiga sesi, pembacaan AD/ART, kode etik auditor, dan usulan program kerja bagi kepengurusan PAHI 2019. “Ada tujuh formatur yang terpilih pada sidang kongres ini,” ujar ketua kongres PAHI 2019 Prof. Dr. Widayat, ST., MT. Ketujuh formatur merupakan hasil dari usulan serta voting yang diberikan oleh peserta auditor yang hadir dari seluruh Indonesia. Sementara dari sidang yang telah dilakukan, ketua terpilih adalah Dr. H. Mustofa Helmi Effendi drh., DTAPH dengan wakil ketua Prof. Dr. Widayat, ST., MT. yang memperoleh tujuh belas suara dari sejumlah peserta yang hadir dalam ruangan. “Pengadaan kongres ini diharapkan mampu memberikan kontribusi baik untuk negara kita maupun kemaslahatan umat Islam,” ujar Wakil Rektor I UNAIR Prof. Djoko Santoso saat menyampaikan harapan dari penyelenggaraan kongres tersebut. Prof. Djoko juga menyampaikan bahwa sedapat mungkin pelaksanaan kinerja PAHI ke depan dapat digunakan sebagai bahan kajian. Selain itu, Prof. Djoko berharap, penjaringan auditor tersebut akan menambah kelengkapan dalam menjalin sinkronisasi antara UNAIR dengan kampus lainnya. (*)'),(194,'In February 2019, FIBAA CEO Professor Dr. Kerstin Fink travelled to the Airlangga University (UNAIR) in Surabaya, Indonesia. The visit enabled an interesting exchange of experience between the two institutions. Indonesia\'s second oldest state university presented its mission as well as its faculties and was highly motivated with regard to the further enhancement of its quality. UNAIR was interested in getting to know a European and internationally oriented accreditation agency such as FIBAA and the standards of the European accreditation system. \"FIBAA offers an extensive knowledge of quality assurance and quality enhancement in higher education and could present the accreditation processes from the European perspective,\" explains Professor Dr. Fink. The event was characterized by a lively interest of the participants and offered an opportunity for an exchange between FIBAA and the representatives of the university. On the part of UNAIR, the course directors, university lecturers and vice-rector Professor Dr. Djoko Santoso attended the event. \"FIBAA was very pleased to have the opportunity to get to know the structure and objectives of UNAIR and to bring European accreditation practice closer to the Indonesian university,\" sums up Professor Dr. Fink. “Thanks to our observer status at the Asia-Pacific Quality Network (APQN), the Asian-Pacific area is one of FIBAA\'s key target regions.”'),(195,'UNAIR NEWS – Waqf is the highest level of philanthropy in Islam. The Universitas Airlangga (UNAIR) Center for Social Fund Management (PUSPAS) is a waqf management work unit in UNAIR that has been officially certified by Indonesian Waqf Agency (BWI) in August 2018. As the first university in Indonesia that has been certified as Nazir Wakaf (waqf managing body), UNAIR provides an introduction to managing cash waqf to 41 student exchange program participants from Prince of Songkla University Thailand. The event was held as the Campus Tour agenda, on Wednesday, March 27, 2019. Twenty-one students of the Islamic Economics Faculty of Economics and Business (FEB) UNAIR participated in the event. Seeing the current condition, waqf is only in the form of mosques and land, Laily Hidayati, S. Kep., Ns., M.Kep., states that cash waqf is a type of waqf that allows applicants from members of community. With only a thousand rupiah, for example, someone can create waqf and get a reward,” she said during presentation in the plenary room of UNAIR Management Office. Based on government regulations, continued Hidayati, sixty percent of waqf funds is channeled to financial investment, and the rest (forty percent) is channeled to the real sector, such as the construction and management of canteens, libraries, and so on. Regarding the management of cash waqf, the Head of PUSPAS UNAIR Dr. Tika Widiastuti, SE., M.Si., explained that the main focus of cash waqf management carried out by PUSPAS was charitable donations and endowments. She also stated that the targets of cash waqf is for education, research, community services, operational events, and many more. “The various procedures we prepared are very easy and practical, so applicants or cash waqf applicants will not feel any difficulties,” she added. Vice Rector I, Prof. Djoko Santoso, dr., Ph.D., Sp.PD., K-GH., FINASIM., said that the BWI certification, UNAIR as the only nazir university, can be a trigger towards Top 500 World Class University (WCU). Hopefully, UNAIR will no longer depend on funds provided by the government , but can manage its own funding sources from the cash waqf in the future. The presentation on cash waqf management was intended to provide education and motivation to students of Prince of Songkla University Thailand. Hopefully Prince of Songkla University Thailand can balance the management between zakat and waqf by applying the procedures that have been presented by PUSPAS UNAIR. In the end of the event, a token of appreciation was handed over by Prof. Djoko Santoso, dr., Ph.D., Sp. PD., K-GH., FINASIM., to the lecturer representative from Prince of Songkla University Thailand. (*) Author: Shofiyyatul Mahrushah Editor: Zanna Afia Deswari'),(196,'UNAIR NEWS – Sebagai salah satu kampus terbaik di Indonesia yang ditarget untuk menjadi perguruan tinggi kelas dunia, langkah internasionalisasi Universitas Airlangga terus digalakkan. Mulai dari perbaikan kurikulum pendidikan, kualitas dan kuantitas riset serta publikasi ilmiah, dan yang tidak kalah penting adalah pengembangan kualitas dan jangkauan pengabdian masyarakat. Untuk itu, UNAIR kembali melakukan akreditasi internasional pada beberapa program studi. Tercatat, sebanyak 14 program studi mengikuti akreditasi internasional ASIC (Accreditation for International Schools, Colleges, and Universities) pada 25 hingga 29 Maret 2019. Dihadapan dua asesor lembaga penilaian pendidikan internasional independen yang berbasis di Inggris itu, Rektor UNAIR Prof. Nasih bersama jajaran pimpinan UNAIR memberikan paparan banyak hal seputar kemajuan dan perkembangan UNAIR. Mulai dari perkembangan kualitas pendidikan, kegiatan akademik, hingga peningkatan sarana prasarana pendukung. Dalam sambutannya di prosesi pembuka akreditasi internasional ASIC (25/3), Prof. Nasih menegaskan bahwa UNAIR secara konsisten penuh mendukung program-program pendidikan yang berlandaskan pada Tri Dharma Perguruan Tinggi. “Semua model pengembangan kampus ini tidak bisa dilepaskan dari prinsip tri dharma perguruan tinggi,” tandas Prof. Nasih. Selanjutnya, untuk melengkapi paparan Prof. Nasih, Wakil Rektor I Prof. Djoko Santoso selaku warek yang mengurusi bidang kurikulum dan pendidikan mengatakan, akreditasi menjadi salah satu upaya dan tanggung jawab bersama untuk meningkatkan kualitas pendidikan. “Hal ini tentu menjadi sebuah upaya bersama untuk melakukan perbaikan-perbaikan dalam kurikulum pendidikan anak didik kita semua,” ungkapnya. Sementara itu, CEO ASIC Lee Hamond dalam kesempatan yang sama juga mengatakan bahwa dalam proses akreditasi ini, pihaknya akan melihat banyak aspek.Mulai dari kelengkapan administrasi hingga kondisi riil yang ada di lapangan dengand data yang sudah diterima. “Kami akan melihat kondisi riil di lapangan dengan berkas dan laporan yang telah disampaikan,” tuturnya. Tercatat, 14 progam studi yang mengikuti akreditasi tersebut terdiri dari 13 progam studi di lingkungan Fakultas Ilmu Sosial dan Ilmu Politik (FISIP) dan 1 prodi di lingkungan Fakultas Imu Budaya (FIB).'),(197,'UNAIR NEWS – Pusat Inovasi Pembelajaran dan Sertifikasi (PIPS) Universitas Airlangga mengadakan workshop yang bertajuk Lokakarya Penyusunan dan Pengembangan Bahan Ajar di Era Milenial, di Ruang Kahuripan 301, lantai 3, kantor Manajemen, UNAIR. Acara pada tanggal 20 Maret 2019 itu dihadiri oleh lebih dari seratus dosen pengajar dari berbagai fakultas di lingkungan UNAIR. Lokakarya tersebut dibuka langsung oleh Wakil Rektor I UNAIR Prof. Djoko Santoso, dr., Sp.PD-KGH, Ph.D., FINASIM. Dalam sambutannya, Prof. Djoko mengutarakan bahwa semua generasi pengajar harus mamu mengikuti perkembangan zaman dengan membuat bahan ajar yang juga dapat bersinergi dengan perkembangan zaman. Termasuk soal pentingnya menulis dan membaca. ”Menulis dan membaca ibarat suami isteri yang keduanya saling berkaitan satu sama lain,” tambahnya. Dari lokakarya itu, diharapkan akan memacu semangat para dosen untuk membuat buku ajar yang benar dan baik. Termasuk sesuai dengan standar ilmiah buku ajar yang dapat dipakai untuk kegiatan pembelajaran mahasiswa. Hadir dalam lokakarya itu Prof. Dr. Bunyamin Maftuh, M.Pd., M.A. ”Bahan belajar yang bagus diharapkan dapat menjadi bekal mahasiswa untuk dapat meningkatkan prestasi mereka,” ungkap direktur Karier dan Kompetensi Sumber Daya Manusia Kemenristekdikti itu. Lokakarya mulai pukul 08.30 WIB tersebut juga menghadirkan pemateri yang memberikan penjelasan terkait dengan teknis penulisan sampai dengan alur pendaftaran buku ke penerbit. Ialah Prof. Dr. Widji Soeratri, Apt, DEA. ”Yang penting harus ada kemauan dosen untuk menulis. Perlu pendampingan kepada para dosen yang ingin mempublikasikan hasil tulisannya mulai dari pendaftaran kepada penerbit hingga percetakan untuk mengatasi kesulitan dalam membuat buku,” katanya. Perlu diketahui, lokakarya tersebut diadakan oleh Pusat Inovasi Pembelajaran dan Sertifikasi (PIPS) UNAIR. Diharapkan kegiatan itu dapat memberikan motivasi kepada dosen untuk membuat buku ajar yang terstandar. Mulai dari isi buku ajar sampai dengan teknis penerbitan. (*)'),(198,'SurabayaInside.com, Surabaya – Duta Besar Pakistan untuk Indonesia, Abdul Salik Khan, melakukan kunjungan ke Universitas Airlangga, Rabu (20/02/2019). Rombongan dari Kedutaan Besar Pakistan ini disambut Wakil Rektor I Prof Djoko Santoso, Wakil Rektor III Prof Amin Alamsjah, dan tim dari Airlangga Global Engagement, serta beberapa pimpinan fakultas. Dalam kunjungan ini, Abdul Salik Khan meresmikan Pakistan Reading Corner di UNAIR. Pojok baca ini didirikan Kedutaan Pakistan dan menyediakan berbagai buku dan bahan bacaan berkaitan dengan Pakistan. Ada banyak informasi dasar antara lain sejarah Pakistan, hubungan Pakistan dan Indonesia, dan bagaimana memperluas kerja sama di berbagai bidang. “Jadi, Anda dapat mengetahui beberapa pengetahuan tentang Pakistan melalui buku. Kami akan memberikan informasi kepada mahasiswa Universitas Airlangga untuk mengetahui tentang Pakistan,” tambahnya. Selain dengan UNAIR, Pemerintah Pakistan juga melakukan kerja sama dengan perguruan tinggi lain di Indonesia. “Kami serius mengembangkan kerja sama ilmu pengetahuan dan teknologi antara Indonesia dan Pakistan. Kedua negara ini anggota OKI (organisasi Konferensi Islam). Melalui lembaga itu, kita dapat membangun kerja sama antara dua negara,” paparnya. Dubes juga mengaku terkesan dengan kunjungan ke Universitas Airlangga. Ia mengungkapkan rasa bangganya karena ada 10 mahasiswa asal Pakistan yang diterima di UNAIR untuk program pascasarjana dan doktoral. “Saya berharap kerjasama ini terus berlanjut di tahun-tahun mendatang. Kami telah menandatangani MoU antara Universitas Airlangga dan beberapa universitas di Pakistan,” terangnya terkait kerjasama antara UNAIR dengan Pemerintah Pakistan. Dikatakan Abdul Salik Khan, saat ini fokus kerja sama yang dikembangkan Pemerintah Pakistan adalah bidang kedokteran, ilmu sosial, ilmu pengetahuan alam, kesehatan masyarakat, dan tak menutup kemungkinan bidang lainnya. “Pakistan negara dengan muslim terbesar kedua dan Indonesia negara dengan muslim terbesar. Ada ruang lingkup yang baik antara kedua negara,” terangnya. Wakil Rektor I Prof Djoko Santoso mengatakan, kunjungan Dubes Pakistan ini kesempatan bagus dalam hal menduniakan Indonesia lewat kerjasama. “Ini kesempatan emas untuk berkomunikasi dengan dunia internasional. Harapannya, kerjasama ini bisa penuh manfaat, terutama antara UNAIR dengan universitas-universitas di Pakistan,” tambahnya. (lin) '),(199,'UNAIR NEWS – Para pemuda di era sekarang harus menciptakan perubahan untuk lingkungan sekitar. Generasi milenial harus kreatif, paling tidak memiliki nilai-nilai kepemimpinan untuk investasi Indonesia yang lebih baik. Demi terwujudnya penerus bangsa yang berkualitas, Koperasi Cempaka ISF menyelenggarakan acara bertajuk Indonesia Scholarship Festival (ISF), Start Struggle Shine, Integrating Education with Innovation Awards Indonesia Golden Generation di Airlangga Convention Center (ACC) UNAIR, Surabaya, pada Jum’at (08/02). ISF menjadi ruang pertemuan antara penyedia beasiswa, kampus terbaik di dunia ,dan calon kandidat mahaiswa terbaik. Tahun ini ISF hanya singgah di 3 kota besar, yakni Kota Jakarta, Yogyakarta, dan Surabaya. ISF menghadirkan pameran beasiswa dan universitas bergengsi dari dalam negeri maupun luar negeri, seperti beasiswa unggulan Kemendikbud, Pusbindiklatren Bappenas, Nuffic Neso, Erasmus+, Aminef (Fullbright), DAAD, dan Australia Awards. Selain itu, ISF juga menghadirkan institusi pendidikan, lembaga bahasa Inggris, serta partisipasi lebih dari 30 top kampus di dunia. Dalam sambutan, Wakil Rektor I Prof. dr., Djoko Santoso Ph. D., K-GH., FINASIM mengatakan generasi milenial di abad 21 akan bisa memperkuat kemampuan kompetisi bila memilih sekolah yang berkualitas. Ia menekankan bagi para pemuda jangan takut bermimpi untuk meraih masa depan gemilang. “Hari ini harus lebih baik dari kemarin, hari esok harus lebih baik dari ini,” tambah Prof. dr., Djoko Santoso Puguh Prasetyo selaku Koordinator Program mengatakan ISF tahun ini mengambil tema  “Mengintegrasikan Pendidikan dengan Inovasi Menuju Generasi Emas Indonesia tahun 2045”. Hal itu bertujuan agar 100 tahun kemerdekaan Indonesia dapat mencapai masa keemasan dan kejayaan. Juga pemuda sebagai efek bonus demoggrafi berperan sebagai ujung tombak tercapainya visi Indonesia 2045 itu. Selama acara, imbuhnya, para pengunjung stand akan diberi tips dan trik mendaftar beasiswa universitas baik (Diploma, Strata Satu, Magister, Spesialis maupun Doktoral), strategi jitu lolos beasiswa pengarahan rencana studi, dan sharing pengalaman pasca kampus sekolah tinggi lanjutan. Tidak hanya pameran beasiswa saja, ISF juga menyelenggarakan Workshop TOEIC, TOEFL, dan IELTS, Start Up & Empowerment Youth Talks, Campus Immersion Class, dan Workshop Proposal dan Penelitian Tesis dan Disertasi.Pada akhir, Puguh Prasetyo berharap para pemuda Indonesia tadak takt untuk bermimpi dan berjuang demi mendapat masa depan yang lebih baik. Penulis: Tunjung Senja WiduriEditor: Binti Q. Masruroh'),(200,'On Tuesday (15/1/2019) Universitas Airlangga (UNAIR) received delegation visit from University of Iowa (UIOWA). In this occassion, UIOWA brought one representative, Dr. Downing A. Thomas as the Associate Provost and also Dean of International Programs University of Iowa. Meanwhile, UNAIR were represented by Prof. Djoko Santoso as Vice Rector I, Dr. Muhammad Madyan as Vice Rector II, Prof. Mochammad Amin Alamsjah as Vice Rector III,  Dr. Junaidi Khotib as Vice Rector IV, Dian Ekowati Ph.D as Deputy Executive Director of Airlangga Global Engagement, and also the Deans from several faculties.   This meeting aims to discuss the future collaborations between UIOWA and UNAIR, focusing on Biomedical Ethics, Human Trafficking, and also Medicine. As one of UIOWA’s partner in East Java, UNAIR want to increase the number of collaborations with UIOWA, including research collaborations and also staff and student exchange program. Through this strategic meeting, the partnership between these two universities are expected to be sustainable.  '),(201,'UNIVERSITAS AIRLANGGA NEWS – Pakistan Ambassador to Indonesia H.E Abdul Salik Khan visited Universitas Airlangga on Wednesday, February 20, 2019. The visit taking place in rector’s room was in the framework of establishing collaboration between the two parties. The arrival of H. Abdul Salik Khan with the delegation from Pakistan embassy was welcomed by UNAIR Vice Rector I Prof. Djoko Santoso, Vice Rector III Prof. Amin Alamsjah, Airlangga Global Engagement’s team and several faculty leaders. H.E Abdul Salik Khan said that he was impressed with Universitas Airlangga. He also expressed his pride because there were 10 students from Pakistan who were accepted in UNAIR for postgraduate and doctoral programs. “I hope this cooperation will continue. We also have signed an MoU between Universitas Airlangga and several universities in Pakistan,” he explained about the collaboration between UNAIR and Pakistan Government. Abdul Salik Khan said that the focus of this cooperation developed by Pakistan Government were in the fields of medicine, social sciences, natural sciences, public health, and other fields. “Pakistan being the second largest Muslim population country and Indonesia as the largest Muslim population country in the world. There is a good scope between these two countries, “he explained. In addition, there was also Pakistan Reading Corner inauguration in UNAIR. H.E Abdul Salik Khan said that it was established by Pakistan Embassy and this corner will provide various books and reading materials related to Pakistan cultures. Pakistan Reading Corner will provide basic information about Pakistan such as the history of Pakistan, the relations between Pakistan and Indonesia, and several scope for expanding cooperation in other fields between the two parties. “Thus, you can gain insight about Pakistan through books. We will provide information to Universitas Airlangga students to find out more about Pakistan, “he added. Beside UNAIR, H. Abdul Salik Khan said that Pakistan Goverment also working along with other universities in Indonesia. “We are seriously working to develop scientific and technological cooperation between Indonesia and Pakistan. These two countries are OIC members and Pakistan has a secretary in Islamabad. Through this institution we can build cooperation between these two countries.” he explained. Meanwhile, Vice Rector I Prof. Djoko Santoso said that it was a good opportunity in the terms of establishing Indonesia through cooperation. The cooperation that will be developed in the future are in the fields of Tri Darma of Higher Education, both in education, research and community service. “This is a golden opportunity to communicate with international world.” said Prof. Djoko. “With this collaboration, we hope that it will give benefits, especially between UNAIR and universities in Pakistan,” he added. (*)'),(202,'UNAIR NEWS – Mengundang seluruh ketua Unit Kegiatan Mahasiswa di Universitas Airlangga, Direktorat Kemahasiswaan mengadakan kegiatan Lokakarya pembekalan Unit Kegiatan Kemahasiswaan (UKM) 2019. Kegiatan tahunan yang diselenggarakan setiap awal pergantian kepengurusan UKM di UNAIR ini dilakukan sebagai upaya pengoptimalan potensi UKM dan penyelarasan tujuan antar keduanya. Berlangsung selama 3 hari di penghujung minggu terakhir bulan Februari (22-24/2), kegiatan bertempat di Ruang Kahuripan Lantai 3, Kantor Manajemen, Kampus C UNAIR. Mempertemukan 42 UKM di UNAIR kegiatan tersebut dibuka oleh Wakil Rektor I Prof. dr., Djoko Santoso, Ph.D., K-GH., FINASIM, dan dilanjutkan serangkaian materi dan diskusi selama 3 hari. “Melawan atau beradaptasi tentu kita semua harus merespon terhadap globalisasi yang ada. Contoh saja China yang tidak terpengaruh karena memiliki Identitas,” tutur Dr. Taufiq Rahman, S.H., M.Si., dalam materi manajemen organisasi. Pada hari pertama dilakukan pengenalan struktur kepengurusan Forum Komunikasi (FORKOM) UKM UNAIR tahun 2019. Menekankan sebagai fasilitator perantara antara UKM dan Direktorat Kemahasiwaan, kepengurusan yang baru berusaha melakukan kewajiban secara berkesinambungan antara keduanya. Pada materi kebijakan pengembangan UNAIR, Drs. Koko Srimulyo menjelaskan bahwa organisasi di masa mendatang harus menunjukkan keunikan serta sudah waktunya berprestasi lebih dari nasional yaitu global. “Tidak hanya IPK, softskill juga harus bagus. IPK hanya 15% untuk daftar kerja. Yang lainnya itu softskill,” ungkap Koko dalam penyampaian materi terakhir di hari pertama. Sabtu di hari yang kedua, mengawali rentetan materi, Karnaji, S.Sos., M.Si., menjelaskan tentang tata aturan peminjaman sarana prasarana dan lingkungan yang harus dilalui oleh UKM untuk mengakses fasilitas yang ada. Karnaji memaparkan detail biaya sewa dan fasilitas apa saja yang didapatkan ketika meminjam tempat tertentu melalui perijinan ke rektorat. Dr. A. Shofy Mubarak, S.Pi, M.Si, selaku pembina UKM UNAIR saat ini menyampaikan tentang strategi pengembangan UKM menuju percaturan global. Dalam kesempatan itu para peserta diarahkan untuk optimal melakukan kegiatan dan berprestasi. “Selalu dulukan yang lebih utama serta jadilah proaktif jangan reaktif,” tutur Shofy. Usai acara, diharapankan UKM bersama pengurus yang baru dapat menjadi lebih baik serta menjadi salah satu pendorong UNAIR menuju 500 universitas terbaik dunia. (*) Penulis : Hilmi Putra PradanaEditor : Binti Q. Masruroh'),(203,'UNAIR NEWS – Universitas Airlangga (UNAIR) held an opinion writing training on Tuesday, February 12 at Campus Management Office C. The activity were attended by around ninety lecturers from all faculties in UNAIR. Prof. Djoko Santoso, Vice Rector 1 of UNAIR gave a speech while sharing his experience in writing opinions. Prof. Djoko also hoped that by holding the event, UNAIR lecturers would be more confident and motivated to write opinions. “Hopefully from this room there will be at least ten percent new writers,” said Prof. Djoko. In addition, Doan Widhiandono, opinion editor of Jawa Pos familiarly called Doan presented as a speaker for the event. On the occasion, Doan explained several reasons for rejecting an opinion article sent to Jawa Pos. According to Doan, writing is selling. When a person sends the results of his writing to media, in this case newspaper, the writer is trying to sell his work. The thing that needs to be considered by author to be accepted in media, the writer must align his writing with the media itself. In addition, author also needs to pay attention to the issues taken as material and writing structure. “As a buyer, I will not buy items that do not suit me or items that will inconvenience me because I have a lot work to do.” said Doan. In addition, Doan also emphasized that the most important thing is not writing ability. Instead, the ability to tell a story or storytelling. “Write as you speak,” said Doan. In storytelling, a person needs to choose and sort out the facts needed to support his writing. Then arranged carefully and set out in written form. In closing, Doan reminded all participants that writing cannot be taught. However, writing skills can be transmitted by getting along and practicing with other senior writers. []'),(204,'Tutwuri.id – Rumah Ginjal diluncurkan pertama kali oleh Guru Besar Ahli Ilmu Penyakit Dalam Fakultas Kedokteran (FK) Universitas Airlangga (Unair) Prof. Djoko Santoso pada bulan September 2018. Di laman www.rumahginjal.id, berbagai artikel menarik seputar ginjal dapat dibaca langsung oleh seluruh lapisan masyarakat. Sebagai seorang ahli ginjal, pria yang juga Wakil Rektor I Unair ini merasa memiliki tanggung jawab moral untuk menyadarkan dan menerangi masyarakat agar kesehatan ginjal mereka semakin konstan. “Sebab, apa yang dia punya itu (ginjal,red) tidak bisa dihitung dengan uang. Tapi, ketika dia jatuh sakit, minimal dia harus punya uang. Padahal belum tentu kekayaan kesehatannya kembali,” kata dia saat bincang santai dengan tutwuri.id di ruang kerjanya, Selasa sore (19/02/2019). Formulasi-formulasi ide, artikel, serta tips sehat ginjal di Rumah Ginjal sebagian diambil dari karya-karya Prof Djoko yang berserakan di media cetak. Sebagian lagi berasal dari buku-buku yang pernah ditulis, seperti 60 Menit Menuju Ginjal Sehat, Membonsai Hipertensi, Siapkan Diri Anda Cangkok Ginjal, dan buku Orang Miskin Boleh Sehat. Menurut dia, karyanya sangat banyak dan bisa dijadikan konten-konten singkat untuk website Rumah Ginjal. “Di samping itu juga ada kegiatan-kegiatan sehari-hari di kampus sebagai Warek I yang berkaitan dengan cetak generasi,” tuturnya. Jadi, lanjut Doktor lulusan Juntendo University, School of Medicine, Tokyo, Jepang ini, sebelum mendirikan Rumah Ginjal, sudah banyak karya yang siap dituangkan. Djoko menyatakan, meski berusia hampir lima bulan, Rumah Ginjal telah dikunjungi sekitar 13 ribu lebih pengunjung. Mereka bukan hanya berasal dari dalam negeri, melainkan juga berasal dari luar negeri. “Rumah Ginjal itu sebetulnya wahana penerang, bimbingan, dari yang dia itu tidak sadar menjadi sadar, yang tidak jelas menjadi jelas, yang tadinya gelap menjadi terang,” ungkapnya. Wahana seperti Rumah Ginjal yang dapat diakses siapa saja dalam waktu 24 jam setiap hari, tidak dia dapatkan saat menulis opini di media cetak yang sifatnya terbatas. Baik dari segi waktu maupun kalangan pembacanya. “Bagi yang membaca tulisan saya saat itu beruntung. Nah, bagi yang tidak? Kemudian saya mempunyai waktu terbatas dan untuk menjangkau semua lapisan masyarakat itu susah. Paling-paling hanya pasien saya saja. Pasien saya kan tidak sampai 15-20. Lantas, yang tidak terhitung itu bagaimana?” tanyanya. Akhirnya, Djokjo membuat suatu kerangka website yang bentuknya dapat dilihat dalam www.rumahginjal.id. Ada tim yang bertugas update informasi terbaru, minimal tiga hari sekali. “Motivasi saya, yaitu bagaimana peran saya itu bisa menjangkau semua lapisan. Akhirnya kita buat website yang sangat menarik untuk bisa diakses siapa saja, sehingga bisa dipraktikan siapa saja,” tegasnya bangga. Lantas, sampai kapan Prof. Djoko akan terus berbagi kepada masyarakat di Rumah Ginjal? “Sampai sekuatnya, kalau bisa seterusnya. Karena itu adalah lahan amal, itu yang utama karena tidak bisa terhitung. Karena orang yang tersesat karena ginjalnya rusak, menjadi tidak tersesat,” pungkasnya. (dwi)'),(205,'UNAIR NEWS – Sebagai salah satu Universitas terbaik di dunia, Universitas Airlangga terus berupaya meningkatkan mutu dan kualitas pendidikan. Salah satunya diukur dengan akreditasi perguruan tinggi dan program studi yang ada. Bukan hanya meningkatkan akreditasi nasional, melainkan juga akreditasi internasional. Untuk itu, melalui Badan Penjaminan Mutu (BPM), UNAIR berkolaborasi dengan Foundation for International Business Administration Acreditation (FIBAA) untuk menggelar workshop. Terutama ditujukan untuk mendorong program studi bersiap melakukan akreditasi internasional. Bertempat di Ruang Kahuripan 301, Kantor Manajemen Kampus C UNAIR, pada Selasa (13/2/2019), hadir jajaran dekan dan wakil dekan seluruh fakultas yang ada di UNAIR. Mewakili Rektor UNAIR Prof. Dr. Mohammad Nasih, S.E., MT., Ak., CMA., hadir Wakil Rektor I UNAIR I, Prof. Djoko Santoso, dr., Sp.PD-KGH., Ph.D., FINASIM., dalam diskusi tersebut. Prof Djoko menyampaikan bahwa workshop itu menjadi langkah yang baik bagi jajaran pimpinan fakultas bersiap melakukan akreditasi internasional. Workshop kolaborasi dengan menghadirkan FIBAA, ungkap Prof. Djoko, mesti dimanfaatkan dengan baik. ”Saat ini UNAIR mempunyai 17 program studi berakreditasi nasional dan 7 program studi berakreditasi internasional,” ungkap Prof Djoko. Diskusi tersebut diawali dengan pengenalan badan akreditasi internasional FIBAA yang dipaparkan langsung oleh Chief Executive Officer (CEO) FIBAA Prof. Dr. Kerstin Fink. Dalam paparannya, Prof. Kerstin menjelaskan bahwa FIBAA merupakan badan akreditasi internasional yang memberikan penilaian mengenai mutu dan kualitas perguruan tinggi. Prof. Dr. Kerstin menambahkan, FIBAA telah berkiprah dalam turut mewujudkan kualitas perguruan tinggi di dunia melalui akreditas selama 25 tahun. Mitra kolaborasi itu bukan hanya berfokus pada kawasan di benua Eropa, melainkan juga di kawasan lain di seluruh dunia. ”FIBAA adalah agen Eropa yang berorientasi internasional untuk penjaminan kualitas dan pengembangan kualitas dalam pendidikan tinggi. Kami melihat diri kami sebagai mitra bagi institusi pendidikan tinggi dan penyedia pendidikan yang sebanding,” ujarnya. ”Fokus disiplin kegiatan kami adalah studi manajemen, hukum, ilmu social, dan ekonomi. Melalui FIBAA, diharapkan workshop akreditasi ini dapat meningkatkan kualitas program studi yang ada di UNAIR menuju World Class university,” tambahnya. (*)  Keterangan Gambar: DARI kiri, Ketua BPM UNAIR Prof. Sukardiman Dr., MS., Apt.; Chief Executive Officer (CEO) FIBAA Prof. Dr. Kerstin Fink.; Wakil Rektor I UNAIR I, Prof. Djoko Santoso, dr., Sp.PD-KGH., Ph.D., FINASIM.; dan Prof. Bambang Sektiari Lukiswanto Drh., DEA., dalam FIBAA Workshop Airlangga University, pada Rabu (13/2/2019). (Foto: Feri Fenoria Rifa’i)'),(206,'UNAIR NEWS – Universitas Airlangga (UNAIR) kembali mengadakan pelatihan penulisan opini pada Selasa (12/2) di Kantor Manajemen Kampus C. Kegiatan tersebut diikuti oleh sekitar sembilan puluh dosen dari seluruh fakultas yang ada di UNAIR. Prof. Djoko Santoso, Wakil Rektor 1 UNAIR hadir untuk memberikan sambutan sekaligus membagikan pengalamannya dalam menulis opini. Prof. Djoko juga berharap dengan diadakannya kegiatan tersebut dosen UNAIR menjadi lebih percaya diri dan termotivasi untuk menulis opini. “Semoga dari ruangan ini terlahir setidaknya sepuluh persen penulis-penulis baru,” ucap Prof. Djoko. Selain itu, Doan Widhiandono, redaktur Opini Jawa Pos yang akrab disapa Doan turut hadir sebagai narasumber. Dalam kesempatan tersebut Doan menerangkan beberapa alasan ditolaknya sebuah artikel opini yang dikirimkan ke Jawa Pos.Menurut Doan, writing is selling. Ketika seorang mengirimkan hasil tulisannya pada media, dalam hal ini surat kabar, maka penulis tersebut sedang berusaha untuk menjual karyanya. Hal yang perlu untuk diperhatikan oleh penulis ketika ingin karyanya diunggah adalah, penulis tersebut harus menyelaraskan tulisannya dengan media yang akan dituju. Selain itu, penulis juga perlu memperhatikan isu yang diambil sebagai materi serta cara atau struktur penulisan karyanya. “Selayaknya seorang pembeli, maka saya tidak akan membeli barang yang tidak sesuai dengan saya atau barang yang akan merepotkan saya karena harus banyak mengedit atau hal lainnya,” jelas Doan. Selain itu, Doan juga menegaskan bahwa dalam penulisan opini, kemampuan yang paling penting bukanlah kemampuan menulis. Melainkan, kemampuan untuk menceritakan suatu cerita atau story telling ability. “Menulislah sebagaimana kamu berbicara,” ucap Doan. Dalam story telling ability, maka seseorang perlu untuk memilih dan memilah fakta yang diperlukan untuk menunjang tulisannya. Kemudian dirangkai dengan hati-hati dan dituangkan dalam bentuk tulisan. Sebagai penutup, Doan mengingatkan kepada seluruh peserta bahwa menulis tidak bisa untuk diajarkan. Namun, kemampuan menulis bisa untuk ditularkan. Yaitu dengan cara banyak bergaul dan berlatih bersama penulis-penulis senior lainnya. Penulis: Galuh Mega KurniaEditor: Nuri Hermawan'),(207,'Rumah Ginjal - UNAIR NEWS – Memasuki tahun akademik 2018/2019, Universitas Airlangga menyambut kedatangan mahasiswa internasional dengan kegiatan bertajuk ”Welcoming Reception International Students”. Kegiatan itu memang dirutinkan untuk menyambut para mahasiswa asing yang akan belajar di UNAIR. Tahun ini kegiatan tersebut digelar pada Kamis (7/2/2019) di Kantor Manajemen UNAIR. Sebanyak 50 mahasiswa internasional yang hadir turut larut dalam gemuruh rianya acara. Mereka tak segan untuk ikut berdendang dalam alunan lagu yang dibawakan oleh tim Paduan Suara Universitas Airlangga (PSUA) yang mengisi acara. Mahasiswa international tersebut datang dari berbagai negara seperti Jerman, Belanda, Malaysia, Filipina, dan beberapa negara di Benua Afrika. Para mahasiswa tersebut merupakan mahasiwa internasional dari berbagai program. Yakni, program AMERTA, ADS (Airlangga Development Scholarship), dan pertukaran pelajar. Hadir dalam kegiatan tersebut Wakil Rektor I Prof. Djoko Santoso, dr., Sp.PD-KGH., Ph.D., FINASIM para wakil Dekan III Fakultas dan para staf Airlangga Global Engagement. Dalam sambutannya, Prof Djoko Santoso berpesan kepada para mahasiswa internasional baru untuk terus mengeeksplor pengalaman dan pendidikan di UNAIR. Sebab, UNAIR membuka kesempatan sebesar-besarnya bagi mereka untuk berpartisipasi dalam kegiatan akademik maupun non akademik. ”Saya harap kalian semua di sini bisa berbaur dengan kami para orang Indonesia dan dapat memahami nilai moral Indonesia. Saya berharap kalian juga bisa menerapkan motto UNAIR Excellent with Morality,” tandas Djoko.   Salah seorang mahasiswa asing bernama Laura Utricht dari Belanda mengaku sangat antusias dengan kegiatan di UNAIR. Dia pun tak sabar untuk segera melakukan kegiatan belajar mengajar dan berkumpul dengan teman yang lainnya.  ”Pertama kali aku sampai di UNAIR, teman-teman sangat ramah menyambutku. Aku jadi merasa tidak takut dan sangat nyaman berada di sini,” ujar Laura.   Bukan hanya kegiatan penyambutan, Airlangga Global Engagement juga mengadakan orientasi bagi mahasiswa internasional yang diadakan pada 7 Februari 2019. Dalam kegitan tersebut, para mahasiswa asing diberi pengarahan oleh staf AGE terkait tips tinggal di Indonesia dan ketentuan- ketentuan belajar di UNAIR.  AGE juga akan membantu dan memfasilitasi para mahasiswa internasional jika pada kemudian hari mengalami masalah seperti jatuh sakit, perpanjangan visa, dan yang lainnya. (*)'),(208,'UNIVERSITAS AIRLANGGA NEWS – After establishing a long-standing partnership with Kobe University, Universitas Airlangga is collaborating again with some institutions. If the previous collaboration with Kobe University was limited to health science, the collaboration they are currently focused on is in form of interdisciplinary workshops. UNAIR and Kobe University will hold “The First Workshop on Humanities and Sciences Cooperative Research for Implementing Global Welfare”. From UNAIR, this workshop involved one of the institutes in the health sector, the Institute of Tropical Disease (ITD). Not only with Kobe University, this workshop also involves three more institutions, Tokyo Women’s Medical University, Japan International Cooperation Agency, and Victoria University of Wellington. Academics from each institution met UNAIR Rector on Monday, January 7. The meeting was attended by UNAIR Rector, Prof. Moh Nasih, Vice Rector I Prof. Djoko Santoso, Vice Rector III Prof. Amin Alamsjah, Head of ITD Prof. Inge Lusida, UNAIR leaders, and delegates from Japan.In the meeting, UNAIR Rector welcomed the guests from Japan. He expressed his joy at the arrival of the academics and hoped they would feel at home in Surabaya. He also hoped that academics can enjoy the workshops and gain useful knowledge.Meanwhile, Vice Rector for Community Service, Research and Publication, Prof. Amin Alamsjah revealed that it was an excellent collaboration because it was multidisciplinary and involved many parties. “So far, we have a long history of cooperation with Japan, especially with Kobe University in terms of health sector. Now we are aiming collaboration with several universities, “explained Prof. Amin. Prof. Amin said that the results of this workshop could later be more comprehensive in improving the welfare of the community.This collaboration will involve several faculties, including Faculty of Medicine, Faculty of Social and Political Sciences, Faculty of Public Health, and other programs related to improving welfare in the health and social fields.Prof. Amin hoped that after the workshop, UNAIR and institutions from Japan can continue their cooperation between both parties. “I hope from this workshop there will be real collaboration to be conducted this year and the upcoming year. For example, related to research, both managed by the government and managed by UNAIR, as well as staff and student mobility,” explained Prof. Amin. (*)'),(209,'Rumah Ginjal - Surabaya (beritajatim.com) – Menuju perguruan tinggi 500 besar dunia (World Class University), Universitas Airlangga (Unair) terus bekerjasama dengan berbagai instansi. Bukan hanya dengan instansi pendidikan dalam negeri namun juga luar negeri. Salah satunya dengan Asia University, Taiwan. Wakil Rektor I Unair Prof. Djoko Santoso, dr., Ph.D., K-GH., FINASIM melakukan penandatanganan kerjasama intership program dengan Dekan International Collage Asia University Prof Yinghuei Chen. Penandatanganan Memorandum of Agreement (MoA) kedua belah pihak berlangsung di Aula Kahuripan 301 Rabu (9/1/2019). Sebelumnya, Unair dan Asia University telah melakukan kerjasama double degree yang kemudian berkembang dengan penandatanganan kerjasama internship program. Atas kerjasama itu, Unair membuka peluang kepada mahasiswa untuk mengikuti pertukaran mahasiswa. Selain itu, mahasiswa juga diberi kesempatan untuk menambah wawasan dan mengembangkan risetnya. Penandatangan MoA intership program merupakan salah satu program Unair dalam mengembangkan dan mengeksplorasi pendidikan antara Wakil Rektor I Unair dengan dekan International Collage Asia University. “Unair akan selalu meningkatkan kerjasama dengan Asia University dalam mendukung Unair menuju World Class University,” ungkap Prof Djoko. Prof Djoko juga menambahkan bahwa Unair sangat peduli terhadap semua aspek yang ada di lingkungan kampus. Tak hanya menekankan pada pembelajaran pendidikan formal, akan tetapi kerjasama riset dan publikasi akademisi menjadi poin penting dalam meningkatkan reputasi perguruan tinggi. Sementara itu, Direktur Airlangga Global Enggagement Prof. Dr. Ni Nyoman Tri Puspaningsih, Dra., M.Si mengatakan bahwa ke depan Prof. Chen akan mengadakan simposium dan workshop di Center for Indonesian Studies, Taiwan. Simposium dan workshop tersebut melibatkan 10 mahasiswa Indonesia dari program S2 dan S3. “Konferensi ini akan dihadiri oleh mahasiswa dengan mengeksplorasi riset yang dikerjakan selama di Taiwan. Kemudian nantinya juga akan mengundang pakar dari Unair untuk menjadi keynote speaker pada acara tersebut,” tandas Prof Nyoman. Setelah penandatanganan MoA, dilanjut dengan diskusi intensif terkait dengan kerjasama riil ke depan untuk magang dan training. Program internship ini terbagi menjadi dua yaitu internship secara langsung dan internship sekaligus pertukaran mahasiswa. Program pertukaran mahasiswa ini akan memberikan kesempatan mahasiswa yang ada di Indonesia untuk mengeksplor pengalaman. Mahasiswa juga disarankan untuk bergabung dengan komunitas-komunitas yang ada di sana. “Kerjasama ini rasanya akan memberikan manfaat bagi kedua belah pihak, baik Unair maupun AU,” tambah prof Nyoman. [kun]'),(210,'Rumah Ginjal - Direktorat Pembelajaran, Direktorat Jenderal Pembelajaran dan Kemahasiswaan, Kementerian Riset, Teknologi, dan Pendidikan Tinggi, menyelenggarakan program Pertukaran Mahasiswa Tanah Air (PERMATA) Nusantara tahun 2018 bagi mahasiswa di seluruh Indonesia untuk memberikan kesempatan kepada para mahasiswa di seluruh wilayah nusantara. Sehubungan dengan hal tersebut maka Direktorat Pembelajaran, Direktorat Jenderal Pembelajaran dan Kemahasiswaan melaksanakan kegiatan pendampingan evaluasi dan penyusunan laporan akhir pelakasanaan program Transfer Kredit Permata di Universitas Airlangga yang berlangsung pada tanggal 17 – 19 Desember 2018 yang berlokasi di Kampus C Universitas Airlangga. Dari Direktorat Jenderal Pembelajaran dan Kemahasiswaan di hadiri oleh Prof. Y. L. Sukestiyarno, M.S, Ph.D dari Universitas Negeri Semarang, Alam  Nasrah Ikhlas, S.S.,M.Ed.L selaku Kasi. Pengakuan Pembelajaran Lampau,  Dr. Andi Ilham Makhmud, Dip. Sc.,M.M.,Apt dari Universitas Hasanuddin. Wakil Rektor I Universitas Airlangga Prof. Djoko Santoso, dr.,Ph.D.,K-GH.,FINASIM membuka acara dan memberikan sambutan, menyampaikan bahawa  “program PERMATA diharapkan menjadi hybrid bagi Universitas, indeks kepuasan metode pembalajaran, team work dan kolaborasi dalam penelitian”. Prof. Y. L. Sukestiyarno, M.S, Ph.D dari Universitas Negeri Semarang sebagai Tim PERMATA menyampaikan beberapa tujuan dari program PERMATA adalah “Work Vision, Compare, memperoleh pengalam yang berbeda dari tempat asal dan Leadership”. Program PERMATA yang ada di Universitas Airlangga diikuti oleh beberapa mahasiswa dari tiga Univerisitas yaitu Universitas Syiah Kuala atas nama Mitha Adistya Putri dari program studi Psikologi dan Nandayani dari program studi Farmasi, Universitas Tadulako atas nama Zulvaningsih Lestari dari program studi Ilmu Komunikasi dan Dhisa Tirza Cintami Maretha dari program studi Akuntansi , Universitas Sumatra Utara atas nama Doni Ananda program studi Keperawatan dan Fatimah Azzahra Program studi Kesehatan Masyarakat. Salah satu mahasiswa program PERMATA Mitha Adistya Putri dari Universitas Syiah Kuala tersebut menyampaikan dengan mengikuti program ini mahasiswa dapat meningkatkan wawasan dengan membandingkan antar host dan visit, mengetahui budaya, membangun rasa kepedulian antar suku, pengembangan wawasan kebangsaan. Dapat membandingkan infrastruktur dari universitas, sharing pengalaman dengan perguruan tinggi asal dan tujuan serta dapat mempererat hubungan antar sesama.'),(211,'UNAIR NEWS – Towards World’s Top 500 universities (World Class University), Universitas Airlangga continues to collaborate with various institutions, not only with educational institutions in the country but also abroad. One of them is Asia University, Taiwan.  UNAIR Vice Rector I Prof. Djoko Santoso, dr., Ph.D., K-GH., FINASIM signed a partnership program on internship with the Dean of International College Asia University Prof. Yinghuei Chen. The signing session of Memorandum of Agreement (MoA) was held in Kahuripan Hall 301 on Wednesday, January 9.  Previously, UNAIR and Asia University had collaborated on a double degree which later developed into an internship program. For this collaboration, UNAIR gives opportunities for students to take part in student exchanges. Students are also given the opportunity to gain insight and develop their research.  The signing of the MoA on intership program is one of UNAIR programs in developing and exploring education between UNAIR Vice Rector I and Dean of International College Asia University.  “UNAIR will always improve cooperation with Asia University in order to achieve UNAIR towards World Class University,” said Prof. Djoko.  Prof. Djoko also added that UNAIR was very concerned about all aspects of the university. It should not only emphasize the formal education learning, but collaboration in research and academic publications is also an important key in improving reputation of the university.  Director of Airlangga Global Engagement Prof. Dr. Ni Nyoman Tri Puspaningsih, Dra., M.Si said that in the future Prof. Chen will hold a symposium and workshop at the Center for Indonesian Studies, Taiwan. The symposium and workshop involved 10 Indonesian students from master’s and doctoral programs.  “This conference will be attended by students by exploring the research conducted while in Taiwan. Then later on, expert from UNAIR will be invited to be keynote speaker in the event, “said Prof. Nyoman.  After the signing of MoA, an intensive discussion was held related to cooperation in the future on internships and training. The internship program will be divided into two, direct internship and internship plus student exchange.  This student exchange program will provide opportunities for students in Indonesia to gain new experience. Students are also advised to join the communities there.  “This collaboration will provide benefits for both parties, both for UNAIR and Asia University,” stated Prof. Nyoman. (*)  Author: Khefti Al Mawalia  Editor: Binti Q. Masruroh'),(212,'Rumah Ginjal - UNAIR NEWS – Menuju perguruan tinggi 500 besar dunia (World Class University), Universitas Airlangga terus bekerjasama dengan berbagai instansi. Bukan hanya dengan instansi pendidikan dalam negeri namun juga luar negeri. Salah satunya dengan Asia University, Taiwan.  Wakil Rektor I UNAIR Prof. Djoko Santoso, dr., Ph.D., K-GH., FINASIM melakukan penandatanganan kerjasama intership program dengan Dekan International Collage Asia University Prof Yinghuei Chen. Penandatanganan Memorandum of Agreement (MoA) kedua belah pihak berlangsung di Aula Kahuripan 301 Rabu (9/1).  Sebelumnya, UNAIR dan Asia University telah melakukan kerjasama double degree yang kemudian berkembang dengan penandatanganan kerjasama internship program. Atas kerjasama itu, UNAIR membuka peluang kepada mahasiswa untuk mengikuti pertukaran mahasiswa. Selain itu, mahasiswa juga diberi kesempatan untuk menambah wawasan dan mengembangkan risetnya.  Penandatangan MoA intership program merupakan salah satu program UNAIR dalam mengembangkan dan mengeksplorasi pendidikan antara Wakil Rektor I UNAIR dengan dekan International College Asia University.  “UNAIR akan selalu meningkatkan kerjasama dengan Asia University dalam mendukung UNAIR menuju World Class University,” ungkap Prof Djoko.  Prof Djoko juga menambahkan bahwa UNAIR sangat peduli terhadap semua aspek yang ada di lingkungan kampus. Tak hanya menekankan pada pembelajaran pendidikan formal, akan tetapi kerjasama riset dan publikasi akademisi menjadi poin penting dalam meningkatkan reputasi perguruan tinggi.  Sementara itu, Direktur Airlangga Global Enggagement Prof. Dr. Ni Nyoman Tri Puspaningsih, Dra., M.Si mengatakan bahwa ke depan Prof. Chen akan mengadakan simposium dan workshop di Center for Indonesian Studies, Taiwan. Simposium dan workshop tersebut melibatkan 10 mahasiswa Indonesia dari program S2 dan S3.  “Konferensi ini akan dihadiri oleh mahasiswa dengan mengeksplorasi riset yang dikerjakan selama di Taiwan. Kemudian nantinya juga akan mengundang pakar dari UNAIR untuk menjadi keynote speaker pada acara tersebut,” tandas Prof Nyoman.  Setelah penandatanganan MoA, dilanjut dengan diskusi intensif terkait dengan kerjasama riil ke depan untuk magang dan training. Program internship ini terbagi menjadi dua yaitu internship secara langsung dan internship sekaligus pertukaran mahasiswa.  Program pertukaran mahasiswa ini akan memberikan kesempatan mahasiswa yang ada di Indonesia untuk mengeksplor pengalaman. Mahasiswa juga disarankan untuk bergabung dengan komunitas-komunitas yang ada di sana.  “Kerjasama ini rasanya akan memberikan manfaat bagi kedua belah pihak, baik UNAIR maupun AU,” tambah prof Nyoman. (*)  Penulis : Khefti Al Mawalia  Editor : Binti Q. Masruroh'),(213,'Rumah Ginjal - UNAIR NEWS – As one of the best universities in Indonesia, Universitas Airlangga continues to improve the quality of education through excellent management. For three consecutive years, UNAIR receives excellent category with 700 points in Malcolm Baldrige on management and institutional governance.  Therefore, other universities often hold management sharing session with UNAIR. One of them was carried out by National Development University (UPN) Veteran Jakarta on Thursday in 3rd Floor Assembly Room C, Management Office Building, Campus C.  UNAIR Vice Rector I Prof. Djoko Santoso, dr., Ph.D., K-GH., FINASIM., attended and opened the discussion. In the benchmarking event, there were officials from the Directorate of Student Affairs, Center for Information and Public Relations (PIH), Integrated Development and Training Institute (LPPT), and Center for Learning and Certification Innovation (PIPS).  Director of Student Affairs Dr. M. Hadi Shubhan., SH, MH, CN.,in his opening remarks said that Student Affairs has four fields of work, Ormawa (student organization); interest, talent, and achievement; reasoning; and student welfare.  “The welfare of these students is related to access on scholarship information and management of student health insurance. There are also division that focuses on PKM (Student Creativity Week, ed), “he said.  Dr. M. Hadi added, the discussion was not in the context of patronizing one another. It was a sharing session and an effort to learn and discuss the management together especially on how to achieve international management accreditation.  In response to Dr. Hadi’s statement, Prof. Djoko welcomed the discussion positively. According to him, efforts to realize campus governance must be encouraged by all parties, both by public and private universities, either old or new.  It has been one of the joint efforts of higher education to realize Indonesia’s progress, especially through the education facilities with good, efficient and effective governance.  “UNAIR as one of the old universities will continue to strive and make better achievements. The latest, UNAIR was awarded excellent category for three times with a value above 700 from Malcolm Badlrige,” he said.  “Such achievement will be continuously encouraged by UNAIR especially to realize the target in 2020 to achieve Top 500 World Class University, “he added.  Meanwhile, Vice Rector III UPN Veteren Jakarta Dr. Ir. Halim Mahfud, M.Sc., on behalf of the team said that the purpose of the benchmarking event was to improve the quality of student affairs and partnerships, especially to learn from UNAIR on the management of students, public relations, and university collaboration.  “Moreover, it is also intended to know more in depth about the management of student activities at Universitas Airlangga as well as the infrastructure needed to support the activities of student organizations so they can make achievements,” he said.  Besides on management of student affairs, the management of the public relations was also presented by Pulung Siswantara S.KM, M.KM as the coordinator of protocols and public service PIH UNAIR. In managing the PKM proposals, Dr. Eduardus Bimo AH, Drh., M.Kes., as PIPS UNAIR secretary, also gave a presentation while Head of LPPT UNAIR Drs. Eko Supeno, M.Si., explained about the management of partnerships in UNAIR. (*)  Author: Feri Fenoria Rifa’i Photo: From the left, Vice Rector III UPN Veteren Jakarta Dr. Ir. Halim Mahfud, M.Sc.; Vice Rector I UNAIR Prof. Djoko Santoso, dr., Ph.D., K-GH., FINASIM.; and Director of Student Affairs Dr. M. Hadi Shubhan., S.H., M.H., CN., in a sharing or benchmarking session on Thursday, December 6 at Management Office Building. (Photo: Feri Fenoria)'),(214,'Rumah Ginjal - SURABAYA (Suaramuslim.net) – Wakaf merupakan salah satu instrumen pembangunan ekonomi yang memiliki potensi besar di Indonesia, dilihat dari sumber daya alam atau tanahnya, jumlah harta wakaf di Indonesia terbesar di seluruh dunia. ini merupakan tantangan bagi umat untuk memfungsikan harta wakaf secara maksimal.  Pusat pengelolaan dana sosial Universitas Airlangga (UNAIR) bekerja sama dengan Badan Wakaf Indonesia (BWI) menggelar Wakaf Goes to Campus III di Aula Garuda Mukti, Gedung Rektorat UNAIR pada Kamis (15/11/2018). Kegiatan Wakaf Goes to Campus ini diselenggarakan di beberapa kampus di Indonesia.  Wakil Rektor I UNAIR Prof. Dr. Djoko Santoso menyatakan, melalui wakaf produktif seseorang dapat menggunakan waktu dan dana yang terbatas namun bisa menghasilkan multiplier effect yang luar biasa.  “Wakaf selama ini masih dipandang sebelah mata dalam berbagai aktivitas ekonomi, termasuk pendanaan pendidikan tinggi di Indonesia. Padahal, jika kita mau merujuk ke negara lain di dunia, wakaf telah memiliki peran sentral dalam pendanaan pendidikan tinggi. Sebut saja salah satu universitas tertua di dunia, Universitas Al Azhar di Mesir dan Harvard,” tutur Djoko.  Prof Djoko menyebut, dengan potensi yang luar biasa, maka universitas dapat menciptakan potensi yang ada. Maka dari itu, harapan dari program Wakaf Goes to Campus bisa mengajak warga kampus terutama kalangan masyarakat mahasiswa untuk bersama-sama BWI dan para pegiat wakaf lainnya memajukan dunia perwakafan di Indonesia.  “Visi ini sangat luar biasa sehingga melalui wakaf akan bersatu padu mencetak generasi pemimpin yang dapat terfasilitasi. Melalui wakaf masuk kampus, memahamkan mahasiswa dan pemahaman itu akan disebarluaskan kepada masyarakat untuk mengejar ketertinggalan Indonesia dalam hal mempercepat peningkatan human development index,” ungkapnya.  Menurut Prof Djoko, jika wakaf di kampus berhasil maka generasi-generasi muda dan pesantren dapat menggantikan yang sudah tua untuk turut memajukan Indonesia.  “Maka wakaf perlu dikumandangkan, dikemas menjadi sesuatu yang menarik bagi generasi muda, termasuk memanfaatkan teknologi masa kini, karena saat ini kita di era milenial,” pungkasnya.   Sementara, Ketua Umum Pelaksana Badan Wakaf Indonesia (BWI) Pusat Prof. Dr. Ir. Mohammad Nuh, DEA dalam sambutan pembukaan Wakaf Goes to Campus di Aula Garuda Mukti, Gedung Rektorat UNAIR pada Kamis (15/11/2018) mengatakan, gerakan wakaf ini hasil kerjasama bersama beberapa kampus, di antaranya Universitas Airlangga, Universitas Islam Negeri Sunan Ampel Surabaya, Universitas Negeri Surabaya, Institut Teknologi Sepuluh November Surabaya serta Gerakan Wakaf Indonesia.  “Dalam hidup terdapat 3 dimensi, masa lalu, sekarang, dan masa akan datang. Yang perlu digarisbawahi adalah yang ketiga, masa mendatang. Artinya jangan sampai kita menderita myopic (rabun jaun) mengalami kesulitan ketika memandang sesuatu yang agak jauh,” kata Prof Nuh.  Prof Nuh mengajak bersama-sama untuk membeli masa depan dengan masa sekarang, maka wakaf ini sangat penting disosialisasikan di lingkungan kampus, karena lingkungan ini merupakan tempat generasi terdidik dan mempunyai masa depan yang baik.  “Mengapa milenial? Karena jika kita melihat generasi Rasulullah, sebagian besar sahabat di sekelilingnya berusia muda. Sebagai contoh, seorang panglima perang yang begitu kuat dan dihormati kaumnya, punya posisi tinggi namun bisa dibunuh dengan hanya serangan dua orang remaja di bawah umur jaman Nabi,” paparnya.  Sementara, lanjut Nuh, Sultan Mehmet II yang juga dikenal sebagai Muhammad Al Fatih berhasil menaklukkan Konstantinopel dan dilakukan pada saat usianya masih 21. Ini merupakan bukti jangan meremehkan anak muda, jika mereka dididik secara benar maka akan menjadi luar biasa.  “Bersyukurlah bagi yang muda, dan lebih bersyukurlah bagi yang tua karena bertemu anak muda,” ucap Nuh yang disambut gelak tawa peserta.  Alasan kedua, menurut Nuh, mengapa harus generasi milenial, karena kelompok ini nantinya akan menjadi kelompok menengah dengan jumlah yang cukup besar disebabkan kita sedang mengalami bonus demografi.  “Di samping itu kelompok generasi ini memiliki kesadaran keberagamaan tinggi, mereka haus dengan teknologi yang melekat di dalam dirinya, sehingga diharapkan mereka menjadi pencetak sejarah baru perwakafan di Indonesia,” tuturnya.  Untuk bisa mengelola harta wakaf yang bersifat produktif, lanjut Nuh, harus orang yang memiliki pengetahuan memadai, berintegritas, dan mempunyai visi entrepreneurship. Karena jika tidak memenuhi poin ketiga, maka wakaf akan menjadi statis yang bertentangan dengan konsep wakaf.  “Syarat yang paling mahal adalah kemampuan nazir untuk mengelola, meningkatkan kesejahteraan, meningkatkan kualitas sistem dakwah, serta menjaga sistem marwah dan martabat bangsa Indonesia. Jangan bangga hanya umat muslim mayoritas tetapi umat muslim harus bisa menjadi umat yang besar dan dengan kualitas daya yang juga tinggi,” tutupnya.  Reporter: Dani Rohmati Editor: Muhammad Nashir'),(215,'UNAIR NEWS – Sebagai salah satu universitas terbaik di Indonesia, Universitas Airlangga terus berupaya meningkatkan kualitas pendidikan melalui pengelolaan yang baik. Terbukti, selama tiga tahun berturut-turut, UNAIR meraih kategori excellent dengan nilai di angka 700 poin di Malcolm Baldrige dalam bidang manajemen dan tata kelola institusi. Karena itu, tidak sedikit kampus lain menggelar sharing pengelolaan dengan UNAIR. Salah satunya dilakukan oleh Kampus Bela Negara Universitas Pembangunan Nasional (UPN) Veteran Jakarta pada Kamis di Ruang Sidang C, Lantai 3, Kantor Manajemen Kampus C. Wakil Rektor I UNAIR Prof. Djoko Santoso, dr., Ph.D., K-GH., FINASIM., turut hadir dan membuka diskusi itu. Turut hadir dalam sharing yang bertajuk Benchmarking Jajaran Bidang Kemahasiswaan dan Kerja Sama tersebut pejabat dari Direktorat Kemahasiswaan, Pusat Informasi dan Humas (PIH), Lembaga Pengembangan dan Pelatihan Terpadu (LPPT), dan Pusat Inovasi Pembelajaran dan Sertifikasi (PIPS).Direktur Kemahasiswaan Dr. M. Hadi Shubhan., S.H., M.H., CN., dalam pembukaannya menyampaikan bahwa Kemahasiswaan memiliki empat bidang garapan. Yakni, ormawa (organisasi kemahasiswaan); minat, bakat, dan prestatif; penalaran; serta kesejahteraan mahasiswa. ”Kesejahteraan mahasiswa ini berkenaan tentang penyediaan informasi beasiswa. Juga pengelolaan jaminan kesehatan mahasiswa seperti asuransi. Selain itu, ada bidang yang fokus pada PKM (Pekan Kreativitas Mahasiswa, Red),” sebutnya. Dr. M. Hadi menambahkan, diskusi pengelolaan itu bukan dalam konteks antara satu dengan yang lain saling menggurui. Konteks sharing tersebut, lanjut dia, menjadi upaya untuk belajar dan berdiskusi bersama. Khususnya bagaimana akreditasi pengelolaan internasional UNAIR bisa dicapai.Menanggapi pernyataan Dr. Hadi, Prof. Djoko menyambut baik diskusi tersebut. Menurut dia, upaya mewujudkan tata kelola kampus mesti didorong semua pihak, baik oleh kampus negeri maupun swasta. Baik yang sudah lama maupun yang masih baru. Hal itu menjadi salah satu upaya bersama pendidikan tinggi untuk mewujudkan kemajuan Indonesia. Khususnya melalui penyediaan fasilitas pendidikan dengan tata kelola yang baik, efisien, dan efektif. ”UNAIR sebagai salah satu kampus yang sudah lama bakal terus berupaya menjadikan capaian baik menjadi lebih baik. Terbaru, UNAIR tiga kali meraih kategori excellent dengan nilai di atas 700 dari Malcolm Baldrige,” ujarnya. ”Capaian semacam itu akan terus didorong UNAIR. Khususnya mewujudkan target pada 2020 meraih predikat Top 500 World Class University,” imbuhnya. Sementara itu, Wakil Rektor III UPN Veteren Jakarta Dr. Ir. Halim Mahfud, M.Sc., mewakili tim menyampaikan bahwa tujuan Benchmarking itu adalah meningkatkan kualitas kemahasiswaan dan kerja sama. Khususnya belajar pada UNAIR terkait dengan pengelolaan kemahasiswaa, kehumasan, dan kerja sama kampus. ”Selain itu, dimaksudkan untuk mengetahui lebih mendalam pengelolaan kegiatan kemahasiswaan Universitas Airlangga serta sarana prasarana yang diperlukan untuk menunjang kegiatan organisasi kemahasiswaan agar berprestasi,” katanya. Di sisi lain, perlu diketahui, selain di bidang kemahasiswaan, dalam Benchmarking tersebut, dipaparkan pengelolaan bidang kehumasan oleh Pulung Siswantara S.KM, M.KM selaku koordinator protokol dan pelayanan publik PIH UNAIR. Juga, soal pengelolaan proposal PKM oleh Dr. Eduardus Bimo A.H, Drh., M.Kes., selaku sekretaris PIPS UNAIR. Ada pula Ketua LPPT UNAIR Drs. Eko Supeno, M.Si., yang memaparkan perihal tata kelola kerja sama di UNAIR. (*) Penulis: Feri Fenoria Rifa’i'),(216,'Surabaya (Antaranews Jatim) - Universitas Airlangga Surabaya menjadi perguruan tinggi pertama yang mendapatkan Nazhir atau pengelola wakaf uang dari Badan Wakaf Indonesia. Ketua Badan Wakaf Indonesia Prof Mohammad Nuh DEA ditemui wartawan di kampus setempat, Kamis, mengatakan, Unair menjadi kampus pertama di Indonesia yang menjadi pengelola wakaf uang. \"Dengan wakaf goes to campus, kami masuk ke kampus-kampus untuk menciptakan literasi sekaligus pemahanan dan kesadaran akan wakaf,\" kata mantan Menteri Pendidikan Nasional era Presiden Susilo Bambang Yudhoyono itu. Nuh menjelaskan manfaat wakaf yang sangat banyak harus disebarkan ke masyarakat melalui Gerakan Wakaf Seribu. Gerakan itu untuk membantu pemerintah membangun bangsa dengan kemampuan diri sendiri. Dia mengatakan, dengan umat islam yang berjumlah 87 persen atau 200-an juta dari total penduduk Indonesia, potensi wakaf untuk pembangunan negeri sangat besar jika dikelola dengan baik. \"Kalau 100 juta orang mewakafkan Rp1.000 ada Rp100 miliar dalam sehari itu dikali 30 hari bisa Rp3 triliun. Ini yang kita tumbuhkan, kesadaran kolektif bahwa kita bisa membantu untuk membangun bangsa cukup dengan Rp1.000,\" ujar mantan Rektor Intitut Teknologi Sepuluh Nopember (ITS) Surabaya itu. Meskipun banyak manfaat yang didapat, wakaf bisa digunakan dengan tepat sasaran asalkan ada teknologinya. Jika tidak, Nuh menilai bisa jadi ongkos untuk membayar lebih besar dibanding iuran. \"Dengan setiap orang yang punya handphone, wakaf akan mudah. Dengan teknologi itu wakaf akan menjadi gaya hidup,\" katanya. Dicontohkannya, dana wakaf bisa dimanfaatkan untuk segala bidang, seperti beasiswa untuk mahasiswa kurang mampu, mendidik wartawan secara profesional dengan gratis, menyekolahkan anak kurang mampu gratis, dan membangun rumah sakit dengan fasilitas pengobatan gratis meskipun ada BPJS. Menurut Nuh, jika nanti wakaf berjalan dan dikelola dengan baik akan mampu membantu pemerintah dengan pinjaman uang bersumber pada suku yang dikeluarkan. \"Daripada meminjam uang dari luar negeri, dana wakaf yang terkumpul dikeluarkan suku. Hasilnya pemerintah memberikan jasa dan yang menikmati masyarakat sendiri. Sekaligus masyarakat punya kebanggan dana wakafnya dipakai. Wakaf di samping untuk kesejahteraan tapi juga martabat bangsa,\" katanya.(*) Pewarta : Willy Irawan Editor: Didik Kusbiantoro COPYRIGHT © ANTARA 2018'),(217,'Rumah Ginjal - UNAIR NEWS – Universitas Airlangga dipercaya menggelar kegiatan anak muda bertajuk Millenials Peace Festival pada Jum’at–Minggu (23–25/11). Pergelaran event di UNAIR itu melanjutkan kegiatan serupa yang digelar di empat kota sebelumnya. Yakni, Jakarta, Bandung, Palangkaraya, dan Pontianak. Surabaya melalui UNAIR menjadi kota kelima penyelengaraan event yang menyasar anak muda milenial tersebut.  Pergelaran event tersebut juga merupakan buah kerja sama UNAIR bersama dengan Global Peace Foudation (GPF). Kali ini event itu mengangkat tema ”Unity in Diversity week”. Event tersebut juga terbuka untuk kalangan umum.  Pembukaan Millenials Peace Festival digelar pada Jum’at (23/11) di Aula Amerta, Lantai 4, Kantor Manajemen UNAIR. Di depan mahasiswa dari internal serta eksternal UNAIR, turut hadir memberikan keynote speech Wakil Gubernur Jawa Timur Terpilih Emil Dardak.  Pada hari kedua, agenda yang digelar meliputi Youth Assmbly, Peace Circle, Peace Project, dan Bincang Damai Nusantara. Selanjutnya, hari ketiga meliputi Charity, Traditional Games, Campaign, dan Flashmob.  Sintya Rahmi dari GPF menyebutkan bahwa berdasar riset, anak muda menjadi target utama terorisme. Sikap alami yang melekat pada anak muda memiliki potensi untuk dibelokkan. Khususnya menyangkut prinsip dan pandangan tertentu.  ”Dan, kita tahu, anak muda tempatnya ada di sekolah (SMA, Red) dan universitas,” ujarnya.  Karena itu, Sintya menyebut diperlukan penanaman nilai-nilai penghargaan pada perbedaan. Salah satunya melalui Millenials Peace Festival tersebut. Dalam event itu, acaranya terbagi atas kegiatan dalam ruang, juga berupa aksi. Turut digelar acara mengunjungi rumah-rumah ibadah dari beberapa agama.  ”Kita sesama manusia adalah bersaudara,” ujarnya.  Sementara itu, Wakil Rektor I UNAIR Prof. Djoko Santoso, dr., Sp.PD-KGH., Ph.D., FINASIM, dalam sambutannya menekankan tugas dan kewajiban yang dipikul para mahasiswa sebagai calon pemimpin masa depan. Segala proses pendidikan selama menjadi mahasiswa mesti diarahkan pada upaya mendukung kesejahteraan masyarakat. Mahasiswa, lanjut Prof. Djoko, harus menyadari kiprah mereka sebagai agen-agen perubahan.  Sebagai calon pemimpin masa depan, Prof Djoko juga menyebut tentang prinsip-prinsip negara yang tetap harus di pegang. Yakni, UUD 1945, Pancasila, Bhineka Tunggal Ika, dan Negara Kesatuan Republik Indonesia (NKRI). Kempat prinsip yang sudah final tersebut tetap menjadi dasar para generasi muda untuk berkarya dan memajukan Indonesia.  ”Poinnya sebagai mahasiswa, adalah kalian menjadi orang yang memiliki jiwa yang penuh manfaat,” sebutnya. (*)   Penulis: Feri Fenoria'),(218,'Rumah Ginjal - UNAIR NEWS – Sebelum turun langsung di tengah masyarakat, sebanyak 146 penanggung jawab daerah menghadiri pelepasan peserta Bidikmisi Goes to School 2018. Bertempat di Aula Student Center, para peserta akan ditempatkan di lima wilayah, yaitu Jawa Timur, Jawa Tengah, Jawa Barat, Madura-Bali, dan luar Jawa. Diadakan pada Jumat (30/11), kegiatan tersebut dihadiri oleh Wakil Rektor I Universitas Airlangga Prof. Djoko Santoso, dr., Ph.D., Sp.PD., K-GH., FINASIM; Direktur Kemahasiswaan Dr. M. Hadi Shubhan., S.H., M.H., CN; Ketua Badan Eksekutif Mahasiswa (BEM) UNAIR  Galuh Teja Sakti; dan Muhammad Nur Rouf selaku ketua Organisasi Bidikmisi Universitas Airlangga (AUBMO). Dalam kesempatan tersebut, Prof. Djoko mengatakan agar para peserta selalu semangat dalam menjalankan tugas serta tidak lupa untuk berdoa. Prof. Djoko juga menitipkan salam kepada keluarga peserta dan para siswa di daerah. ”Menolong tidak melulu memberi pakai uang, tapi bisa dengan apa yang kita punya,” tambahnya. Selaras dengan hal tersebut, Dr. Hadi menuturkan tujuan dari kegiatan itu ialah agar mahasiswa menjadi ”penyambung lidah rakyat” bagi UNAIR kepada masyarakat, khususnya memberikan akses informasi pendidikan masyarakat di pelosok-pelosok. Tujuannya adalah masyarakat mengetahui adanya beasiswa Bidikmisi. UNAIR sebagai universitas terbesar di Indonesia timur merasa perlu membangun semangat berpendidikan tinggi dalam lingkar bayang-bayang biaya yang mahal. ”Di samping bangga, kita harus mawas diri karena UNAIR,” imbuhnya. Di UNAIR, lanjut Dr. Hadi, jika ada mahasiswa yang diterima di UNAIR mendaftar Bidikmisi, maka bisa dipastikan akan mendapatkan beasiswa Bidikmisi. Hal itu dibuktikan dengan sekitar 20 persen mahasiswa UNAIR adalah penerima beasiswa Bidikmisi. ”Jika diterima Bidikmisi, janganlah memikirkan biaya. Tapi fokuslah pada akademik,” ucapnya. Dr. Hadi menambahkan, adanya Bidikmisi dapat memutus rantai kemiskinan di masyarakat. Anak bangsa yang kurang mampu, tapi memiliki potensi dapat melanjutkan pendidikan yang tinggi dengan adanya Bidikmisi. Sementara itu, Ayyun, penanggung jawab Bidikmisi Goes to School 2018 mengatakan bahwa kegiatan tersebut merupakan waktunya bagi para peserta untuk mempersiapkan bekal yang cukup guna disosialisasikan kepada calon penerus bangsa di daerah masing-masing. Diharapkan, lanjut dia, BMGTS 2018 sesuai dengan temanya ”pemerataan pendidikan” BMGTS tersebut dapat menyasar sekolah yang kurang mengetahui mengenai Bidikmisi. ”Ada yang belum tahu informasi mengenai Bidikmisi. Padahal, sebenarnya mereka bisa masuk Bidikmisi. Jadi, saya harap informasi mengenai Bidikmisi ini bisa diserap oleh semua siswa di seluruh Indonesia,” pungkasnya. (*) Penulis: M. Najib Rahman Editor: Feri Fenoria'),(219,'Rumah Ginjal - UNAIR NEWS – Teriakkan suara pendukung kembali bersahut-sahutan saat sesi pemilihan duta Universitas Airlangga menjelang pada akhir pengumuman pemenangnya. Sebanyak 20 finalis duta Universitas Airlangga dari setiap fakultas saling menunjukkan kemampuan dan keterampilan terbaik mereka di depan dewan juri dan pendukung pada Rabu malam (21/11) di Airlangga Convention Center (ACC) Kampus C UNAIR. Rintikan hujan yang cukup deras membuka ajang pertunjukkan bertajuk Grand Final Pemilihan Duta Universitas Airlangga 2018 tersebut. Calon duta UNAIR 2018 tersebut terdiri atas sepasang wakil duta UNAIR dari fakultas. Ketua Paguyuban Duta UNAIR Ichwan Firmansyah menyatakan bahwa ajang tersebut merupakan agenda rutin tahunan. Sebelum acara puncak itu, digelar seleksi meliputi babak penyisihan 1 dan 2. Seusai terpilih, para kontestan duta UNAIR 2018 mengikuti karantina yang terbagi atas tiga sesi, yaitu sesi 1, 2, dan 3. Menjelang akhir, diadakan meet the judges serta diakhiri dengan malam puncak Grand Final. Atas penyelengaraan tahun ini, dia berharap pemenang maupun kandidat yang lain mampu mendukung dan turut serta mewujudkan program UNAIR masuk top 500 world class university. ”Alhamdulillah, grand final ini bisa terselenggara. Siapa pun nanti pememenangnya, semoga nanti mampu mendukung program kampus, Universitas Airlangga, menuju top 500 world class university,” ujarnya. Menanggapi penyelengaraan Grand Final itu, Direktur Kemahasiswaan UNAIR Dr. M. Hadi Subhan, SH., MH., CN., dalam sambutannya menyampaikan apresiasi kepada penyelenggara dalam hal ini Paguyuban Duta Universitas Airlangga. Melalui ajang itu, wakil kampus melalui Duta UNAIR bisa terpilih dengan baik. Sebab, menurut Hadi, Duta UNAIR merupakan personifikasi dari mahasiswa Universitas Airlangga secara umum. ”Merekalah (Duta UNAIR, Red) adalah personifikasi kemampuan-kemampuan mahasiswa di Universitas Airlangga,” ujarnya. Sementara itu, menambahkan pernyataan direktur Kemahasiswaan UNAIR, Wakil Rektor I UNAIR Prof. dr., Djoko Santoso, Ph.D., K-GH., FINASIM., menyebut Duta UNAIR diharapkan menjadi bintang yang tidak sekadar bintang. Duta UNAIR diharapkan bukan hanya menjadi figur yang memiliki kemampuan berbicara dan berkonsep. Namun, mereka diharapkan mampu memberikan dampak nyata kepada masyarakat. ”Betapa hebatnya bila kalian (Duta UNAIR, Red) juga mampu mendorong Universitas Airlangga menjadi World Class University,” sebutnya. Prof Djoko turut mendorong Duta UNAIR mampu menebar semangat kepada teman-teman sesama mahasiwa untuk bisa mengomunikasikan pengetahuan dan keilmuan mereka melalui tulisan. Yang pada akhirnya, konsep-konsep yang didapat dari proses pendidikan mampu diaplikasikan dan berdampak nyata secara langsung kepada masyarakat. ”Kalian mesti mampu menghipnotis kolega-kolega kalian untuk terus berkarya dan bermanfaat kepada masyarakat,” tuturnya.  Dalam serangkaian kegiatan Grand Final itu, penampilan ke-20 finalis melengak-lengok di atas panggung membuka kemeriahan malam itu. Sontak, pendukung dari setiap pasangan finalis berlomba-lomba menujukkan kreativitas dukungan mereka berupa zel-zel dan teriakan. Para pendukung juga tampak membawa ornamen dukungan berupa balon berbentuk huruf dan balon berwarna. Senyum dan busana dari setiap finalis juga tampak begitu anggun diiringi sorotan lamu warna-warni yang memancar. Sesi pembuka tersebut tambah terlihat begitu meriah atas penampilan menyanyi bersama para finalis pada sesi pembukaan berikutnya. Melalui serangkaian proses-proses yang panjang, sesi tanya jawab kepada setiap finalis, akhirnya diumumkan sejumlah nama pemenang ajang pemilihan Duta UNAIR malam itu. Berikut daftar pemenangnya, Duta UNAIR yang Terpilih adalah Muhammad Fadhel Maulana dan Chorisma Permata Putri Nurazizah; Wakil Duta UNAIR yang Terpilih, Abu Rizal Dwikatmono Johan dan Aisyah Putri Rahvy; Duta Persahabatan Kevin Prianto; dan Duta Terfavorit Selvia Yuliani DRS. (*)'),(220,'Rumah Ginjal - UNAIR NEWS – Era kekinian yang sering disebut sebagai era milenial dengan perkembangan teknologi yang pesat turut memunculkan problem di berbagai ranah bidang kehidupan. Salah satunya adalah bidang kesehatan. Bahasan mengenai tantangan-tantangan yang harus dihadapi semua negara tampak begitu menarik. Misalnya, problem kesehatan yang dihadapi Indonesia selama 73 tahun Indonesia merdeka. Bukan berarti bernilai kurang, tapi optimalisasi bidang-bidang lainnya perlu dilakukan. Khususnya dalam mempersiapkan ketahanan kesehatan Indonesia. Melihat tren ketahanan kesehatan itu, Prof. Djoko Santoso dr., Ph.D., Sp.PD.K-GH.FINASIM., mengakui bahwa kondisinya membaik, namun belum paripurna. Berdasar data, lanjut Prof. Djoko, angka harapan hidup masyarakat Indonesia antara 48 tahun dan 66 tahun. Di sisi lain, angka kematian bayi menurun dari 118 per seribu kelahiran (1970) ke 35 per seribu kelahiran (2003). Bahkan menjadi lebih baik menjadi 32 per seribu kelahiran (2006). ”Tapi yang dihadapi, kematian balita keluarga miskin empat kali lebih tinggi dibandingkan yang kaya,” ujar wakil rektor I UNAIR tersebut. Menurut Prof. Djoko, terdapat problem juga yang harus dihadapi terkait dengan biaya dan disparitas layanan kesehatan. Misalnya, pengeluaran kesehatan yang harus dicukupi seseorang mencapai 75–80 persen biaya kesehatan. Total pengeluarannya lebih kecil jika dibandingkan dengan negara tetangga, yakni rata-rata mencapai USD 16 per orang per tahun (2001). ”Sebanyak 20 persen penduduk termiskin hanya menerima kurang dari 20 persen dari total subsidi kesehatan pemerintah,” sebutnya. Karena itu, menurut Prof. Djoko, terdapat beberapa hal yang bisa dilakukan terkait dengan penanganan peningkatan kesehatan. Misalnya, mempromosikan kesehatan. Sebab, terdapat kecenderungan kebijakan yang dilakukan lebih kepada penanganan dibanding pencegahan. Promosi kesehatan menjadi sangat penting menekan banyaknya kebutuhan biaya yang selama ini harus dikeluarkan. ”Juga, mengurangi ketidaksetaraan, memperhatikan determinan: pekerjaan dan perumahan, memperhatikan kesehatan komunitas, pendidikan, gaya hidup atau pendidikan kesehatan, dan pengawasan penyakit tertentu,” ungkapnya. Berikutnya, penanganannya adalah soal perbaikan layanan kesehatan. Yang menjadi perhatian, kata Prof. Djoko, adalah kebijakan dan rencana sistem kesehatan, kualitas dan standar, layanan kesehatan berbasis bukti, tata kelola klinik, efisiensi, serta audit dan evaluasi penelitian. Prof Djoko juga menyinggung beberapa hal yang mesti dilakukan oleh perguruan tinggi dalam mendukung optimalisasi ketahanan kesehatan nasional. Yakni, perguruan tinggi mendorong mahasiswa melakukan penelitian bertema kesehatan untuk menemukan jalan komunitas sehat. Artinya, komunitas yang tidak rentan dari penyakit menular dan tidak menular. ”Termasuk juga meningkatkan kesadaran kesehatan melalui advokasi yang meng-impowering semua pihak agar lebih serius peduli terhadap perbaikan kesehatan bangsa,” tuturnya. Pada akhir, Prof Djoko menekankan tentang pentingnya pendekatan kemanusiaan dalam mengoptimalkan ketahanan kesehatan agar mampu dicapai. Lebih tepatnya, orientasi kebijakan yang terkait dengan kesehatan itu mengacu pada pewujudan nilai kemanusiaan kepada seganap bangsa, tanpa mempertajam perbedaan-perbedaan. ”Pada akhirnya, masing-masing dari kita harus mengedepankan human being kita,” pungkasnya. (*)'),(221,'Rumah Ginjal - UNAIR NEWS – Bertepatan dengan Hari Ulang Tahun Ke-64 pada Sabtu (10/11), UNAIR mengadakan diskusi bersama delegasi dari Asia University. Dalam diskusi tersebut, UNAIR dan Asia University, Taiwan menekankan pembahasan terkait koordinasi program double degree. Rapat tersebut dihadiri oleh delegasi dari Asia University yang dipimpin oleh Prof. Yinghuei, Chen. Selain itu, turut hadir perwakilan setiap fakultas. Termasuk sekolah Pascasarjana UNAIR dan Fakultas Vokasi.Setidaknya, dalam rapat tersebut, hadir Wakil Dekan I Fakultas Sains dan Teknologi (FST) Dr. Hartati, M.Si.; wakil direktur I Sekolah Pascasarjana, Wakil Dekan III Fakultas Ekonomi dan Bisnis (FEB) Dr. Nisful Laila, SE., M.Com; FISIP; dan F.Psi. Sementara itu, Wakil Rektor I UNAIR Prof. Dr. Djoko Santoso., Ph.D, K-GH., FINASIM, dalam sambutannya berharap kerja sama antara UNAIR dan Asia University terus terjalin dengan baik. Dalam diskusi tersebut Prof. Djoko berharap Asia University dapat memberikan informasi terkait kebijakan di sana. Baik terkait tuition fee maupun persyaratan mahasiswa. ”Biaya hidup mahasiswa selama di sana (Taiwan,red) seharusnya tidak menjadi kendala besar. Mengingat, biaya hidup di sana tidak terlalu berbeda dengan di Indonesia,” ungkapnya. Selain itu, Prof. Djoko mengungkapkan harapannya terkait kemungkinan UNAIR dapat melakukan korespondensi dengan Asia University. Yakni, kemungkinan pihak UNAIR dapat mengajar dan melakukan research di Taiwan, di Asia University. Di sisi lain, Prof. Yinghuei, Chen atau yang akrab disapa Prof. Chen dalam rapat tersebut menjelaskan bahwa untuk biaya kuliah di Asia University adalah sebesar 1600 USD per semester. Selain itu, terdapat biaya asrama selama lima bulan mencapai 400 USD. Prof. Chen juga menyarankan mahasiswa untuk membeli private insurance untuk enam bulan pertama untuk kemudian bisa membeli national insurance. ”Untuk mahasiswa dari Indonesia dan lokal akan membayar biaya kuliah yang sama. Kemudian untuk Bachelor dan Master Degree kurang lebih sama,” ucap Prof. Chen. Meski begitu, mahasiswa dapat bekerja selama 20 jam per minggu selama di Taiwan untuk menambah uang saku. Namun, jika melebihi waktu yang tentukan tersebut, maka dibutuhkan ijin kerja. Setidaknya terdapat lima fakultas yang direncakan mengikuti program double degree. Yakni, Sekolah Pascasarjana jurusan ekonomi islam dan teknobiomedik; FIB jurusan linguistik (master); FEB jurusan manajemen (sarjana dan master); serta fakultas vokasi jurusan pariwisata, manajemen, English dan akuntasi. (*)  Penulis: Galuh Mega Kurnia Editor: Feri Fenoria Keterangan Gambar: DARI kiri, Prof. Yinghuei, Chen bersama dengan Wakil Rektor I UNAIR Prof. Dr. Djoko Santoso., Ph.D, K-GH., FINASIM., saat rapat di Ruang Sidang Pleno, Lantai 3, Kantor Manajemen UNAIR. (Foto: Galuh Mega Kurnia)'),(222,'Rumah Ginjal - Ilmu dan skill para tenaga medis perlu diasah agar senantiasa update mengikuti perkembangan teknologi kedokteran yang senantiasa melesat. Pakar ginjal Prof Djoko Santoso, dr., SpPD., KGH, PhD menjelaskan, profesi dokter tak bisa lepas dari situasi “mendadak”yang menuntut adanya kesigapan dalam menangani kasus kegawat daruratan. Hal ini sangat erat kaitannya dengan proses pengambilan keputusan dalam melakukan tindakan medis yang tepat untuk keselamatan para pasiennya. Di tengah berbagai situasi yang tidak menentu, para tenaga medis dituntut untuk pandai mengimbangi ilmu yang dimiliki dengan pesatnya kemajuan teknologi kedokteran yang mau tak mau akan menggiring mereka masuk kedalam area persaingan global. “Sejauh ini banyak sekali seminar kesehatan yang segmentasinya lebih kepada dokter spesialis, untuk itu perlu digelar seminar emergency untuk kalangan dokter non spesialis” ujarnya. Menurutnya, dokter umum perlu dibekali dengan ilmu dan teknik emergency yang tepat. Dengan memiliki skill, maka para dokter umum bisa dengan sigap menangani kasus tertentu. “Sebelum kasus pasien ini jatuh ke tangan dokter spesialis, dokter umum dapat mengatasinya terlebih dulu, sebelum akhirnya diputuskan untuk dirujukkan ke Rumah sakit atau Dokter spesialis lainya. Sehingga dapat menekan angka mordibitas dan morbilitas,”ungkapnya. Naskah : Sefya H Istighfaricha Sumber foto : Navalwiki'),(223,'Rumah Ginjal - Selain Penyakit auto imun (hipertensi) dan Diabetes, ternyata Penyakit gagal ginjal akut juga termasuk ke dalam jenis penyakit yang sering dikeluhkan pasien di RSUD Dr. Soetomo, Surabaya. Dampak mortalitas dan morbiditas akibat penyakit ini pun terbilang serius. Mayoritas pasien baru gagal ginjal baru memeriksakan dirinya ke dokter sudah dalam kondisi akut. Hal ini yang mengakibatkan tingginya angka kematian penderita gagal ginjal. Pakar ginjal FK UNAIR Prof . Djoko Santoso, dr., SpPD., KGH, PhD menganggap perlu adanya kesigapan para dokter umum setiap kali menghadapi kasus yang tergolong emergency ini. “Selain dokter spesialis, dokter umum sebenarnya juga punya porsi untuk menekan angka mortalitas dan mordibitas penyakit gagal ginjal,” ungkapnya. Djoko menjelaskan batu ginjal amat erat kaitannya dengan resiko terjadinya infeksi pada saluran kencing (ISK). Adanya batu di saluran kencing bisa saja mengancam nyawa si penderita, meskipun kasus demikian dianggap sangat langka. Atau dalam hal ini diartikan dengan sebutan Urosepsis. Urosepsis merupakan suatu kondisi terjadinya sindroma peradangan sistemik yang diakibatkan karena bakteri yang berasal dari saluran kemih tersebut. Adanya kondisi SIRS (Systemic Inflammatory Response Syndrome) atau sindroma inflamasi sistemik yang ditandai dengan suhu yang tinggi atau sangat rendah, nadi yang sangat cepat, lekositosis, pernafasan yang cepat dengan bukti disebabkan oleh adanya suatu infeksi baik lokal maupun sistemik. Kondisi ini yang disebut dengan sepsis. Lalu bagaimana infeksi lokal dapat menyebabkan sepsis? Djoko menjelaskan karena bakteri dapat menghasilkan toksin, baik endotoksin maupun eksotoksin, maka toksin ini yang kemudian beredar ke dalam darah sehingga menyebabkan reaksi SIRS. “Bakteri yang terlanjur menyebar ke dalam aliran darah (bakteriemia) yang menyebabkan SIRS inilah yang disebut dengan septicemia,”ungkapnya. Jadi kondisi septikemia merupakan kondisi yang sangat berat karena SIRS yang terjadi disebabkan oleh bakteri yang telah menyebar ke dalam aliran darah. Artinya bakteri telah menyebar keseluruh tubuh. Parahnya lagi, Septikemia ini mampu merusak sistem pertahan tubuh, sehingga akhirnya dapat merusak keseimbangan tubuh dan berakhir dengan disfungsi multi organ. “Saluran perkencingan normalnya harus lancar dan bersih, karena sesuatu aliranya yang abnormal, karena batu, tumor, dan prostat yang membesar, akhirnya menghambat saluran perkencingan”ujarnya.  Naskah: Sefya H IstighfarichaSumber Gambar: Hello Sehat'),(224,'Rumah Ginjal - Infeksi saluran kencing tidak hanya menghantui para penderita penderita diabetes, tapi juga perempuan hamil, seseorang dengan prostat membesar, serta pasien yang sering melakukan cangkok ginjal. Pakar ginjal FK UNAIR Prof Djoko Santoso, dr., SpPD., KGH, PhD menjelaskan, pada wanita hamil terjadi perubahan hormonal sekaligus mengalami penurunan daya tahan tubuh. Karena mengikuti tumbuh kembang janin di dalam rahim, maka pada saluran kencing sang ibu mengalami pelebaran, sementara kondisi saluran uretra berubah menjadi lebih pendek ( 3-5 cm). Kondisi ini mengakibatkan kuman lebih mudah masuk masuk sehingga perempuan hamil beresiko mengalami infeksi. Untuk itu, Djoko menyarankan bagi perempuan hamil untuk melakukan pemeriksaan urin. Tujuannya untuk mengetahui apakah ada kemungkinan mengalami ISK tanpa gejala, atau tidak. Apabila diketahui beresiko mengalami ISK, maka harus secepatnya ditentukan letak kelainan anatomik pada saluran kemih yang mendasari timbulnya gejala tersebut. Dan harus segera dilakukan terapi drainase serta pemberian antibiotika yang sesuai. Sementara untuk mengatasi masalah keracunan (uranium) sampah-sampah metabolisme tubuh dengan cara cuci darah, dan mensupport ginjal dengan menggunakan mesin cuci darah.“Tanpa drynase maka pemberian manfaat antibiotik tidak akan berjalan dengan baik,”ungkapnya. Usai melewati fase kegawat daruratan, langkah selanjutnya tinggal memikirkan apa penyebab dan jenis batu apa yang menghambat saluran kencing. Apabila disebabkan karena non sumbatan maka selanjutnya dapat diatasi dengan pemberian antibiotik. Sementara pemeriksaan lain bisa menggunakan USG atau Foto contas.Sementara untuk proses pemecahan batu dapat dilakukan secara mekanik dengan memakai energi hidrolik, energi gelombang suara atau energi laser. Upaya menjaga kesehatan ginjal bisa dilakukan dengan cara minum air putih 3 ½ liter perhari, olah raga teratur, dan mengatur pola konsumsi asupan protein perhari yakni 1 gram / hari, atau dengan mengkonsumsi makanan rendah protein sebanyak 0,6 gram/ hari.“Mengkonsumsi makanan dengan protein berlebih hingga 1,2 gram lebih dapat memicu menumpuknya sampah metabolik yang dapat menyebabkan endapan di ginjal. Jadi jangan berlebihan dan jangan sampai kurang,” ujarnya. Naskah: Sefya H Istighfaricha sumber foto: Kaiser Health News  '),(225,'Rumah Ginjal -  UNAIR NEWS – Universitas Airlangga terus mengupayakan internasionalisasi pendidikan. Selain dengan kolaborasi riset dan pengabdian masyarakat, salah satu upaya itu terwujud melalui penyelenggaraan pameran pendidikan internasional. UNAIR kembali mengadakan pameran pendidikan Taiwan bertajuk Taiwan Higher Education Fair 2018 pada Oktober 2018. Taiwan Higher Education Fair 2018 terselengara atas kerja sama antara Taiwan Education Center in Surabaya Indonesia (TECSID) dan Universitas Airlangga. Digelar pada Senin (22/10) di Hall Kantor Manajemen Universitas Airlangga, Taiwan Higher Education Fair 2018 menghadirkan informasi pendidikan universitas ternama di Taiwan. Pengunjung bisa mendapatkan informasi kuliah dan beasiswa mulai S1, S2, hingga S3 di Taiwan langsung dari para pewakilan universitas Taiwan yang menghadiri acara tersebut. Acara dibuka langsung oleh Wakil Rektor I Universitas Airlangga Prof. dr., Djoko Santoso Ph. D., K-GH., FINASIM.; Direktur Jenderal TETO Surabaya Mr. Benson DS Lin; dan Ketua Delegasi Universitas Taiwan Prof. Yang Liang-Yo. Pada pembukaan, Prof Djoko menyatakan bahwa acara ini diharapkan dapat membawa UNAIR menuju TOP 500 World University. ”Kerja sama ini bisa menguntungkan kedua belah pihak dan membuat masa depan menjajikan bagi keberlangsungan universitas masing-masing,” ungkap Prof Djoko. Pada pameran tersebut, terdapat sepuluh universitas terkemuka di Taiwan yang berpatisipasi. Yakni, Asia University, Chienkuo Technology University, China Medical University, Fu Jen Catholic University, Aohsiung Medical University, National Chi Nan University, National Taiwan University, Shih Chien University Kaohsiung Campus, Steering Committee for the Test of Proficiency–Huayu, dan Wu Feng University. Menariknya, beberapa mahasiswa Indonesia di Taiwan ikut meramaikan acara dengan berbagi tips dan pengalaman mereka selama studi di Taiwan. Di samping informasi belajar dan beasiswa di Taiwan, acara itu juga menampilkan informasi seputar kehidupan di Taiwan. Di antaranya, soal pengalaman mereka belajar sembari bekerja paruh waktu bagi mahasiswa dan mengurus visa, dan program pemerintah Taiwan yang mengundang warga Indonesia untuk belajar budaya dan bahasa Taiwan melalui beasiswa Huayu Enrichment Scholarship Program. Selain di Surabaya, kegiatan itu juga diadakan di dua kota lain, yakni di Malang dan Denpasar. Di Malang, kegiatan tersebut diselenggarakan pada tanggal 22 Oktober 2018 di Universitas Muhammadiyah Malang Kampus III. Sedangkan di Denpasar diadakan pada 25 Oktober di Universitas Udayana Kampus Sudirman. “Harapan saya higher education fair seperti ini bisa terus berlanjut sampai tahun berikutnya, tidak hanya Taiwan juga bisa dengan negara lain,” pungkas Prof. Djoko. (*)  Penulis: Tunjung Senja Widuri Editor: Feri Fenoria'),(226,'Rumah Ginjal - UNAIR NEWS – Kolaborasi pendidikan dengan perguruan tinggi di Asia terus diperkuat Universitas Airlangga. Salah satunya dengan negara-negara ASEAN, yakni Malaysia. Bersama dengan UiTM (Universiti Teknologi MARA) Malaysia, UNAIR melalui Fakultas Ilmu Sosial dan Ilmu Politik (FISIP) menggelar kolaborasi pendidikan berwujud program inbound 2018. Sebanyak 27 delegasi UiTM mengikuti kegiatan Welcoming Reception Kunjungan Universiti Teknologi MARA (UiTM), Malaysia, di Kantor Manajemen, Kampus C, UNAIR, pada Selasa sore (6/11). Wakil Rektor I UNAIR Prof. dr. Djoko Santoso, Ph.D., K-GH., FINASIM.; Dekan FISIP Dr. Falih Suaedi, Drs., M.Si.; dan Dian Ekowati (SE., M.Si., M.AppCom (OrgCh)., Ph.D., turut hadir dalam acara tersebut. Berdasar agenda, UiTM mengirimkan total 27 delegasi ke FISIP. Mereka terdiri atas 3 lecturer dan 24 students. Sementara itu, UiTM juga mengirimkan sebanyak 23 delegasi untuk mengikuti kegiatan di Fakultas Vokasi. Untuk di FISIP, program tersebut dimulai pada Sabtu (3/11) dan akan diakhiri pada Rabu (7/11), total selama lima hari. Rencananya, selain program akademik di FISIP, delegasi UiTM mengikuti program kegiatan di luar. Di antaranya program community service di hutan Magrove Wonorejo, pengenalan tempat bersejarah di Surabaya, dan kunjungan ke Mal Pelayanan Publik Surabaya, Siola. Termasuk melihat Command Center 112 Surabaya serta Koridor Co-working Space, sebuah ruang kerja bersama yang bertujuan mewadahi inovasi dan kolaborasi anak muda kreatif di Surabaya. Terkait dengan itu, Dr. Falih dalam sambutannya menyampaikan bahwa kunjungan UiTM ke FISIP merupakan kunjungan yang kali kedua. Hal itu, lanjut dia, menunjukkan adanya keinginan yang kuat antar kedua pihak untuk meperkuat kerja sama maupun kolaborasi. Tepatnya sebagai upaya meningkatkan kualitas institusi masing-masing. ”Kunjungan ini juga mengandung makna strategis karena kami bisa menjalankan banyak program. Misalnya, student inbound, staff inbound, dan puncaknya kita sepakat double degree,” ujarnya. Sementara itu, Dr. Suhaimi Bin Hj Abd Samad dalam sambutannya mengungkapkan sambutan yang baik atas kerja sama yang telah terjalin. Dia menilai kerja sama tersebut menjadi langkah yang tepat. Mengingat, UNAIR menjadi salah satu perguruan tinggi negeri terbaik di Indonesia. ”Saya berterima kasih kepada Dr Falih, khususnya UNAIR. Semoga ke depan akan terjalin kolaborasi kerja sama yang lebih mantab lagi,” ungkapnya. Menanggapi kunjungan UiTM itu, Prof. dr. Djoko dalam sambutannya menyampaikan bahwa UNAIR tengah memberikan porsi yang berlebih para program-program internasional. Tepatnya sebagai bagian dari upaya mewujudkan target UNAIR masuk jajaran 500 World Class University. Prof. Djoko menerangkan, saat ini UNAIR terus berupaya mewujudkan akreditasi internasional, tepatnya pada program studi. Misalnya, akreditasi ASIIN, AUN, dan beberapa akreditasi yang lain. Dia juga mengungkapkan bahwa UNAIR melibatkan audit ekternal Malcolm Baldrige terkait dengan manajemen. Kepada seluruh peserta, Prof Djoko berharap sejumlah pengalaman lain, luar akademik, juga bisa dipetik. Misalnya, soal kondisi sosial budaya masyarakat Surabaya yang pasti berbeda dengan di Malaysia. Selain itu, peserta mesti mampu menemukan konsep-konsep permsalahan yang ada sekaligus menemukan solusinya. Lebih tepatnya, melalui pengalaman-pengalaman yang baru dan berebda selama di UNAIR. ”Dengan kolaborasi dan kerja sama semacam ini, diharapkan kedua pihak mampu sama-sama mengambil keuntungan untuk dapat meningkatkan kualitas maupun reputasi kampus masing-masing,” sebutnya. Perlu diketahui, sejumlah agenda telah menanti peserta. Secara garis besar, agenda itu terbagi menjadi dua, yaitu Academic Visit dan Guest Lecture and Management Meeting. Di antaranya, Guest Lecture 1 dengan topik 10 Global Challenges for Social Security, Asia and the Pacific: Policy Response for Dynamic Implementation oleh Dr. Suhaemi Abd Samad di ruang Adi Sukadana; Parallel Class 2 Lecture dengan topik Governance and Accountability in Administration: Western vs Islamic Perspective oleh Dr. Memiyanty bt Haji Abdul Rahim di Adi Sukadana; dan Parallel Class Lecture 3 dengan topik Public Financial Reforms: Tightening the Belt oleh Cik Azila. (*)  Penulis: Feri Fenoria Keterangan Gambar:SESI foto bersama delegasi UiTM, Malaysia, dengan Wakil Rektor I UNAIR Prof. dr. Djoko Santoso, Ph.D., K-GH., FINASIM.; Dekan FISIP Dr. Falih Suaedi, Drs., M.Si.; dan Dian Ekowati (SE., M.Si., M.AppCom(OrgCh)., Ph.D., dalam Welcoming Reception Kunjungan Universiti Teknologi MARA (UiTM), Malaysia, di Kantor Manajemen, Kampus C, UNAIR, Selasa sore (6/11). (Foto: Feri Fenoria)'),(227,'Rumah Ginjal - UNAIR NEWS – Kolaborasi dunia pendidikan dan industri memang menjadi sebuah keharusan. Pasalnya, dengan kolaborasi tersebut, riset dan inovasi yang lahir dari dunia pendidikan dapat diwujudkan melalui dunia industri untuk kemudian digunakan oleh khalayak. Guna mendukung langkah tersebut, Universitas Airlangga dengan beberapa institusi  menggelar “The 23rd Seminar and 12th Conggress of Indonesia Society for Biochemistry and Molecular Biology in Conjunction with The 2th International Conference”. Kegiatan yang fokus pada “Collaboration Seminar of Chemistry and Industry (CoSCI) itu dilangsungkan di Aula Garuda Mukti Kampus C UNAIR, Kamis (11/10). Hadir mewakili rektor, Wakil Rektor I UNAIR Prof. Djoko Santoso, dr., Ph.D., Sp.PD., K-GH., FINASIM. Dalam sambutannya,  Prof. Djoko mengatakan bahwa pertemuan tingkat internasional itu menjadi salah satu pendorong untuk terus melahirkan inovasi bagi dunia pendidikan dan industri. Pasalnya, imbuh Prof. Djoko, dunia pendidikan dan industri harus bergandengan tangan untuk meningkatkan produk yang dibutuhkan oleh masyarakat dan pelanggan. “Jika semua bisa berkolaborasi, maka inovasi yang luar biasa akan kita lahirkan untuk kemaslahatan umat,” tandasnya.Tidak hanya itu, dalam acara yang akan dilangsungkan selama dua hari ke depan itu, Prof. Djoko mengimbau agar semua peserta bisa peka dengan kondisi di era milenial ini. Dalam forum diskusi nanti, imbuhnya, Prof. Djoko berharap akan ada transfer ilmu pengetahuan antara bidang riset dan praktik di dunia industri.“Kami harap semua saling menguatkan antara publikasi, riset, dan praktik di lapangan agar bisa tercipta suatu hal yang sangat bagus,” paparnya. Sementara itu, menambahkan pernyataan Prof. Djoko, sebagai salah satu penanggung jawab acara Prof. Dr. Ni Nyoman Tri Puspaningsih, Dra., M.Si., mengatakan bahwa konferensi internasional itu adalah kesempatan yang baik bagi pelaku di dunia akademik dan indutsri untuk bertukar pandangan. Oleh sebab itu, Prof. Nyoman berharap agar kegiatan itu bisa menjadi momen untuk berbagi dan diskusi bagi pembangunan biokimia dan biologi molekuler di Indonesia.“Dan semoga ini bisa menjadi jembatan untuk terus berkolaborasi antara universitas dan dunia industri,” tuturnya. Penulis: Nuri Hermawan'),(228,'Rumah Ginjal - UNAIR NEWS – Keberhasilan pemisahan kembar siam dempet panggul (pygopagus) Rochman-Rochim, tidak dipungkiri merupakan hasil sinergi inovasi antara RSUD Dr. Soetomo dan Fakultas Kedokteran Universitas Airlangga. Karena itu, untuk mengantisipasi keberhasilan pemisahan kembar siam lain, bila ada, kedua lembaga itu jangan sampai dipisahkan. Sebaliknya justru harus semakin dipererat untuk menghasilkan inovasi-inovasi dalam dunia kedokteran. Harapan tersebut disampaikan Rektor Universitas Airlangga Prof. Dr. Moh Nasih, SE., MT., Ak., CMA., ketika memberi sambutan dalam “Pelepasan Kembar Siam Rochman-Rochim”, di Aula Loka Widya Husada RSUD Dr. Soetomo (RSDS), Kamis (11/10).  REKTOR UNAIR Prof. Moh Nasih dan Direktur RSUD Dr. Soetomo dr. Harsono menyerahan catatan buku harian kembar siam Rochman dan Rochim kepada perawat Pustesmas Mojowarso Jombang, Yulia Fatmawati, yang membantu kelahiran kembar siam itu. (Foto: Bambang Bes) Pemulangan Rochman-Rochim dari RSUD Dr. Soetomo ke rumahnya di Mojowarno, Kab. Jombang itu, setelah Rochman dinyatakan sembuh pasca menjalani operasi rekonstruksi vesica urinaria. Secara seremonial, pemulangan dilakukan Rektor UNAIR bersama Direktur RSDS Dr. Harsono, ditandai dengan penyampaian buku catatan harian Rochman-Rochim kepada Yulia Fatmawati, perawat Puskesmas Mojowarno, yang menangani kelahiran bayi kembar siam itu pada 4 September 2009. Rektor juga memberikan bingkisan kepada kedua bocah tersebut. Hadir dalam acara tersebut antara lain Wakil Rektor I UNAIR Prof. Djoko Santoso, dr., Ph.D., Sp.PD., K-GH-FINASIM, Sekretaris Universitas Airlangga Koko Srimulyo, Drs., M.Si., Dekan Fakultas Kedokteran UNAIR Prof. Dr. Soetojo, dr., Sp.U(K), dan Ketua Pusat Kembar Siam Terpadu RSDS Dr. Agus Haryanto, Sp.A(K).'),(229,'Rumah Ginjal - UNAIR NEWS – Antraks dan avian influenza (AI) masih menjadi problem bidang zoonosis di Indonesia yang membutuhkan perhatian serius. Zoonosis merupakan bidang penyakit yang disebabkan organisme infeksius seperti virus, bakteri, dan parasit yang dapat ditularkan dari hewan kepada manusia, termasuk sebaliknya.Peningkatan kemampuan pencegahan, pendeteksian, dan penanganan oleh institusi terkait terhadap penyakit zoonosis sangat diperlukan. Terutama menyangkut integrasi upaya bersama antara peneliti dan pemerintah dalam menghadapi problem-problem yang muncul di masyarakat. Sebagai bagian dari upaya tersebut, Universitas Airlangga melalui Airlangga Disease Prevention and Research Center (ADPRC) menggelar One Health Research Translation Workshop pada Rabu (10/10) hingga Kamis (11/10) di Aula Tandjung Adiwinata, Gedung Fakultas Kedokteran Hewan (FKH) UNAIR. Workshop itu memberikan perhatian yang lebih terhadap identifikasi peluang untuk menerapkan penelitian pada kebijakan pengendalian penyakit zoonosis. Menurut Ketua Panitia Prof. Dr. Fendik Abdul Rantam, DVM., hasil workshop tersebut diharapkan bisa diterapkan pada institusi maupun lembaga seluruh peserta. Mengingat, sejumlah peserta dalam workshop itu berasal dari dinas-dinas pemerintah. Workshop tersebut, lanjut Prof. Fendik, merupakan buah kerja sama ADPRC dengan Indonesia One Health University Network (Indohun). Mengingat ADPRC merupakan One Health Collaboration Center (OHCC). Termasuk hasil kerja sama dengan Gryphon Scientific; Colege of Veterinary Medicine, University of Minnesota; BEP, Biosecurity Engagement Program Amerika Serikat; dan International Federation of Biosafety Associations (IFBA). ”Workshop ini berfokus pada pengendalian penyakit antraks dan avian influenza. Mengingat, kedua penyakit masih menjadi problem yang kita hadapi,” ujarnya. Prof. Fendik menyampaikan bahwa antraks di Indonesia sudah endemik lama. Khususnya sejak muncul kasus di Purwokerto, Gorontalo, dan Jawa Tengah. Antraks, lanjut dia, merupakan penyakit yang menyerang pada sapi, tapi bisa menular kepada manusia. Kuman pada antraks sangat sulit diberantas. Penyebabnya, kuman itu membentuk spora, yaitu satu atau beberapa sel yang terbungkus oleh lapisan pelindung atau bulatan. Seiring berjalannya waktu, spora itu bisa membuka dan dapat menyerang manusia. ”Kuman (bakteri, Red) itu berlindung di dalam spora itu,” sebutnya. ”Sampai 16 tahun (spora, Red). Pada babi di Papua itu baru muncul,” imbuhnya. Menurut Prof. Fendik, kini terjadi perbedaan terkait dengan kebijakan yang berpengaruh pada pengendalian persebaran penyakit tersebut. Bukan berarti kebijakan tersebut berpengaruh langsung, bernilai kurang. Namun, di sektor lain, potensi persebaran penyakit bisa tinggi. Misalnya, soal kebijakan pasar atau ekonomi. Lebih tepatnya soal pergerakan, jual beli, sapi lintas daerah dan kawasan. ”Itu (pergerakan jual beli sapi) sulitnya mengontrol. Makanya, antara peraturan dan perdagangan kan sulit,” ungkapnya. ”Jadi, di satu sisi, kalau ditutup, nggak jalan perdagangan. Di sisi lain, penyakit bisa tersebar,” imbuhnya.Avian Influenza (AI) pun demikian. Prof. Fendik menjelaskan, AI menular melalui udara, juga bisa melalui kontak langsung. Karena itu, AI menjadi penyakit strategis yang memiliki dampak ekonomi yang cukup besar. Termasuk untuk keamanan negara. ”Kalau ini (penyakit zoonosis) benar-benar tidak bebas, bagaimana orang mau datang ke sini (Indonesia),” katanya.Karena itu, tutur Prof Fendik, penting melakukan pendekatan penanganan itu melalui riset. Selanjutnya, riset tersebut digunakan untuk policy, kebijakan. Pada dasarnya, menurut dia, bagian mana yang lebih dulu, antara policy dan riset, tidak menjadi patokan utama. Sebab, keduanya sangat berpengaruh. ”Kalau saya, dua komunikasi yang balance (seimbang), dua arah. Tidak salah satu. Agar kita bisa memecahkan masalah,” ucapnya. ”Informasi riset dipakai policy. Policy juga menentukan bagaimana riset yang harus dilakukan. Ya kan,” tambahnya.Prof. Fendik melanjutkan, jika tidak dengan komunikasi dua arah, diperlukan strategi komprehensif. Hal itu menjadi sangat penting agar tujuan atau hasil itu bisa tercapai. Sementara itu, Wakil Rektor IV UNAIR Prof. Djoko Santoso dr., Ph.D., Sp.PD.K-GH.FINASIM., sangat mengapresiasi pergelaran workshop itu. Keberadaan UNAIR sebagai bagian dari pengabdian harus terasa. Baik dalam lingkup nasional maupun internasional. Khususnya melalui kegiatan penelitian dan riset terhadap kasus-kasus yang muncul di masyarakat.”Pendidikan dan penelitian adalah bagian yang tidak boleh dipisahkan,” ujarnya. ”Workshop ini menjadi sangat penting sebagai media diskusi inovasi terbaru. Tepatnya untuk membentuk gaya hidup masyarakat secara baik. Sebab, gaya hidup sangat dipengaruhi oleh upaya pengendalian atas temuan penelitian yang merugikan,” imbuhnya. (*) Penulis: Feri Fenoria'),(230,'Rumah Ginjal - UNAIR NEWS – UNAIR Tapak Suci Student Activity Unit for the first time held an international event “Airlangga Tapak Suci University Open International Championship 2018” on September 12-16. Motivated by the achievement of Indonesian team which won 14 gold medals at Asian Games and desire to strengthen ties of youth through pencak silat, UKM Tapak Suci held an international event. “A total of 8 national competition have been held, this is the first time we hold international event,” said Mohammad Wahyu Syafi’ul Mubarok, student of 2016 Physics Program. The head of the committee said that the classes competed were men’s individual A-J class and women’s A-F class. There is also team category, single and double, men’s and women’s. Furthermore, each of these categories is divided into unarmed and armed. Wahyu Syafi’ul also explained that the individual and double-unarmed is a competition that presents an athlete demonstrating the diverse unarmed techniques of Tapak Suci martial arts. The armed category also showcased the skill of handling weapons. Vice Rector I UNAIR Prof. Dr., Djoko Santoso Ph. D., K-GH., FINASIM emphasized that this event was important not only for UKM Tapak Suci but for UNAIR as well towards Top 500 World Class University in 2019. The competition also invited the East Java Vice Governor elected for 2019-2024 period Emil Elestianto Dardak . In his speech, Emil praised UNAIR for holding an international competition. “Pencak silat can shape the character of the young generation, a fighter must have a great soul, noble heart, and strong attitude like a knight,” concluded Emil.  Author: Tunjung Senja Widuri Editor: Nuri Hermawan '),(231,'Rumah Ginjal - UNAIR NEWS – Universitas Airlangga kembali menerima kunjungan dari Dewan Perwakilan Rakyat Republik Indonesia (DPR-RI). Kali ini, kunjungan dilakukan oleh Panja Kelembagaan dan Akreditasi Prodi Perguruan Tinggi (KAP-PT) Komisi X DPR-RI. Bertempat di Ruang Sidang Pleno Kampus C UNAIR (13/9), kunjungan itu membahas mengenai “Pengawasan Tata Kelola Kelembagaan dan Akreditasi Program Studi di UNAIR pada Masa Persidangan I Tahun Sidang 2018-2019”. Hadir langsung menerima kunjungan dari KAP-PT Komisi X DPR-RI, Rektor UNAIR Prof. Moh. Nasih bersama jajaran pimpinan di lingkungan UNAIR. Prof. Nasih juga memberikan paparan mengenai kondisi dan perkembangan UNAIR. Dalam paparannya, Prof. Nasih mengatakan bahwa pihaknya sangat bersyukur menerima kunjungan KAP-PT Komisi X DPR-RI. Pasalnya, dengan mengetahui kondisi perkembangan UNAIR, diharapkan DPR-RI dapat memberikan berbagai pertimbangan kebijakan untuk kemajuan pendidikan di UNAIR dan umumnya untuk pendidikan nasional. “Dan tentunya, dengan pertemuan ini diharapkan dapat bermanfaat untuk mengembangkan almamater dan pendidikan yang menjadi amanah kita semua,” ungkap Prof. Nasih. Mewakili pihak Komisi X DPR-RI, Dr. Ir. Djoko Udjianto, M.M., selaku Ketua Komisi X DPR-RI mengatakan bahwa daya saing dikancah global ditentukan dengan kualitas pendidikan nasional. Untuk itu, imbuhnya, sebagai bagian dari kampus tertua di Indonesia, UNAIR yang telah melintasi berbagai perubahan dinamika bangsa, tentu harus mampu memberikan warna bagi pendidikan di Indonesia. “Terlebih, sebagai PTN-BH yang ditargetkan untuk maju menjadi kampus 500 besar dunia, tentu UNAIR membutuhkan dukungan kita semua untuk melakukan pengembangan dan perbaikan,” jelasnya. Sementara itu, Direktorat Jenderal Kelembagaan Kementerian Riset, Teknologi, dan Pendidikan Tinggi (Kemenristek Dikti) Dr. Ir. Patdono Suwignjo mengatakan bahwa dalam mengembangan institusi pendidikan tinggi, ukuran kemajuan tidak diukur dalam tataran jumlah. Untuk itu, dalam mengembangan kualitas pendidikan di Indonesia, terlebih dahulu menggenjot kampus yang sudah berstatus PTN-BH untuk bisa masuk dalam jajaran kampus berkelas dunia. “PTN-BH yang kami dorong menjadi 500 dunia ini memang mendapat tambahan anggaran. Tapi mereka juga mendapat tambahan tugas yang lebih,” tandasnya. Penulis: Nuri Hermawan'),(232,'Rumah Ginjal - UNAIR NEWS – Tim B-STEAM terima penghargaan setara  emas pada  kategori presentasi dan poster pada Pekan Ilmiah Mahasiswa Nasional (PIMNAS) 31. Event terbesar kemahasiswaan di Indonesia ini dilaksanakan pada penghujung bulan Agustus sampai awal September (30/08 – 02/09) di Universitas Negeri Yogyakarta (UNY). Tim PKM bimbingan Kustiawan Tri Pursetyo, S.Pi, M.Vet adalah tim campuran antar fakultas di UNAIR yang semuanya merupakan anggota Unit Kegiatan (UKM) Penalaran. Tim B-STEAM beranggotakan Ningsih Putri Herman (Kimia/2017), Hilmi Putra Pradana (Teknologi Lingkungan/2016), Akhmad Affifudin Al-Anshori (Kedokteran Hewan/2016), Mulida Agustina (TIHP/2017), dan Ula Zidni A. I. (TIHP/2016) sebagai ketua tim. Sedikit menengok kebelakang, saat Monitoring dan Evaluasi (Monev) Eksternal, Ula sapaan akrab ketua tim sendiri sudah mengira bahwa timnya akan lolos pada ajang bergengsi PIMNAS itu. “Prediksi awal sudah, karena juri mengkode dengan ucapan selamat bertemu di Yogyakarta setelah sesi tanya jawab. Alhamdulilah saat pengumuman lolos PIMNAS Allah berkehendak dan meridhoi tim kami lolos,” tutur Ula. Perjuangan tak sampai disitu, tim B-STEAM beserta 6 tim lainnya langsung dipersiapkan untuk menuju PIMNAS 31 sekitar 1 bulan lamanya. Selama persiapan pasti tak semulus yang terlihat karena tentunya ada masalah. Ula sendiri mengakui sering terdapat gesekan antar anggota tim dan perbedaan pendapat.Tapi Ula bersyukur Garuda Sakti memberikan pendamping IKA-PIMNAS, Siti Nurmala, yang selalu bersabar mendampingi disetiap langkah serta dosen pembimbing yang selalu ada. “Terima kasih untuk Pak Kus selaku dosen pembimbing yang selalu memantau dan mendengar keluh kesah kami, meski dalam masa studi S3 di Malaysia dan bantuan dari seluruh dosen TPK,” ungkap Ula. Ula menambahkan, ia mewakili tim juga sangat berterima kasih kepada Dr. Eduardus Bimo Aksono H., M. Kes., drh dan Nita Citrasari S.Si., M.T., yang tidak pernah bosan untuk memberi masukan, kritik, dan saran. Tim B-STEAM ini, presentasi di hari pertama pada urutan ke-4 ketika memasuki waktu maghrib. Ula menjelaskan, saat presentasi tidak disangka video yang disiapkan di powerpoint tidak mau berputar, tapi untung saja blocking dapat dilakukan. Hal itu sedikit berdampak saat sesi tanya jawab yang menjadi sangat tegang tapi tetap semua pertanyaan dapat dijawab dengan lancar. Saat pengumuman haru terasa pada GOR UNY tribun huruf N. Ula meyakini sampai sekarang, apapun hasilnya kontingen PIMNAS 31 UNAIR  sudah berusaha yang terbaik. “Terima kasih sudah mau berbagi ilmu, saling menyayangi, dan berjuang keras bersama-sama. Kalian orang-orang yang hebat,” tutur Ula untuk semua. Penulis : Hilmi Putra Pradana Editor : Nuri Hermawan'),(233,'Fakultas Vokasi Universitas Airlangga, misalnya, terus melakukan perbaikan dan pengembangan kurikulum demi menghasilkan formula pengajaran yang mampu bersaing dengan dunia internasional. Selanjutnya, fakultas yang baru berdiri pada 2014 ini bekerja sama dengan lembaga Senior Experten Service (SES) Jerman dalam rangka diskusi dan penyusunan kurikulum. Jerman sebagai negara yang diakui memiliki pendidikan vokasi terbaik diharapkan mampu memberikan berbagai masukan terhadap kurikulum yang digunakan fakultas vokasi dalam menyiapkan lulusannya.  Salah seorang narasumber dari SES Jerman memaparkan kurikulum pendidikan vokasi Wakil Dekan I Fakultas Vokasi Prof Dr Retna Apsari M.Si mengakui, kurikulum adalah gerbang utama menuju internasionalisasi. Karena itu, kurikulum yang setara dengan pendidikan vokasi yang lain mesti diwujudkan. \"Internasionalisasi mulainya kan dari kurikulum. Kalau kurikulum sudah setara dengan yang lain, nanti bisa kredit transfer,\" ujarnya. Dia menyatakan, kurikulum yang belum setara dengan perguruan tinggi penyelenggara pendidikan vokasi di luar negeri memunculkan kendala tersendiri. Sebab, mahasiswa yang melaksanakan program pertukaran pelajar ke luar negeri tidak bisa melakukan kredit transfer karena kurikulum yang belum setara. \"Mahasiswa yang melakukan outbound terkendala kredit transfer karena kompetensinya berbeda. Kalau nanti kompetensinya sudah sama, internasionalisasi itu akan bisa lekas terwujud,\" ungkap Retna. Fakultas Vokasi, Unair, yang tergabung dalam Forum Pendidikan Tinggi Vokasi Indonesia (FPTVI), sepakat untuk mulai menerapkan kurikulum 3+2+1. Masukan kurikulum dari SES akan dijadikan pertimbangan untuk menentukan kurikulum baru yang digunakan pada 2018. Retna menuturkan, kurikulum yang dipakai di Jerman tidak bisa sepenuhnya diterapkan di Indonesia. Sebab, kebutuhan industri keduanya sangat berbeda. Meski baru permulaan, melalui kerja sama dengan SES Jerman, Retna berharap langkah internasionalisasi semakin terwujud. \"Ini memang baru permulaan. Paling tidak kami mulai internasionalisasi dengan pakarnya langsung untuk diimplemetasikan ke kurikulum. Tahun depan kongres nasional kami ajak satu atau dua orang untuk berembuk dengan Jerman,\" tambahnya. Senada dengan Retna, Wakil Rektor I Bidang Pendidikan dan Kemahasiswaan Prof Djoko Santoso, dr., Sp.PD-KGH., Ph.D., FINASIM berharap kerja sama dengan SES Jerman tidak hanya berlangsung sekali, tapi bisa periodik. Tujuannya, menyempurnakan program internasionalisasi di fakultas vokasi. \"Sebab, bagaimanapun, negara industri punya banyak kehebatan sehingga bisa dicontoh,\" ucapnya.  Selanjutnya, Djoko berharap, setelah kurikulum baru tersebut terbentuk dan mulai diaplikasikan, fakultas vokasi bisa meluluskan mahasiwanya sesuai dengan kompetensi yang dibutuhkan di masyarakat. (*)'),(234,'Rumah Ginjal - UNAIR NEWS – Monitoring dan Evaluasi (Monev) Program Kreativitas Mahasiswa 5 (lima) Bidang Tahun 2018 di Universitas Airlangga, dibuka secara resmi oleh Wakil Rektor I UNAIR Prof. Djoko Santoso, dr., Ph.D., Sp.PD., K-GH., FINASIM., di Lt-III Gedung Kahuripan, UNAIR kampus C, Rabu (18/7). Monev atas gelaran acara yang diselenggarakan oleh Ditjen Belmawa Ristekdikti ini berlangsung dua hari hingga Kamis (19/7). Hadir dalam pembukaan Monev PKM 2018 itu adalah para reviewer yang ditugaskan Ditjen Belmawa, yaitu Prof. Dr. Ir. I Nyoman Sucipta, MS (Universitas Udayana), Erika Takidah, SE., M.Si (Universitas Negeri Jakarta) dan Dra. Titiana Irawani, M.Sn dan Soewardi, M.Sn., keduanya dari Istitut Seni Indonesia (ISI) Yogyakarta. Selain itu juga Direktur Kemahasiswaan UNAIR Dr. M. Hadi Shubhan, SH., MH., CN. Dalam Monev eskternal tersebut keempat reviewer akan mengevaluasi sebanyak 134 proposal PKM yang didanai Kemenristekdikti asal sembilan perguruan tinggi. Proposal PKM tersebut, antara lain 110 dari mahasiswa UNAIR, sembilan dari mahasiswa Universitas Trunojoyo Madura (UTM), empat naskah dari Universitas Muhammadiyah Sidoarjo, empat naskah dari Universitas Islam Madura, dua dari mahasiswa Universitas Wiraraja, dan masing-masing satu naskah dari Poltek Madura, STKIP PGRI Bangkalan, STKIP PGRI Sidoarjo, dan Universitas Madura. Dalam sambutannya, Prof. Djoko Santoso mengatakan bahwa program PKM Kemenristekdikti ini merupakan program sangat mulia. Obyeknya diharapkan sebagai ikatan antar generasi muda sebagai calon pemimpin bangsa dalam sebuah team work. Sebagai suatu sarana untuk mematangkan leadership melalui kompetisi edukatif. ”Sehingga monev ini antara lain sebagai sebuah strategi seleksi dalam membangun calon pengganti pemimpin, baik pemimpin disini (perguruan tinggi – red) maupun di pemerintahan. Sehingga dalam monev ini bagaimana persiapan Anda ditantang untuk bisa melewati kaidah-kaidah ilmiah yang sudah ada standarnya,” kata Prof. Djoko, Guru Besar FK UNAIR itu. Tantangan dan seleksi tersebut harus dilakukan karena kita akan menghadapi revolusi industri 4.0, sehingga sebagai bangsa juga ditantang untuk maju dan berkembang agar suatu saat nanti tidak kalah dengan kemajuan teknologi. ”Kalau dalam monev nanti ada yang tidak terpilih dan lolos ke PIMNAS (Pekan Ilmiah Mahasiswa Tingkat Nasional), itu bukan gagal, tetapi hanya tertunda saja. Sehingga tidak boleh jera, tetapi harus terus berinovasi dan berinovasi,” tandas Prof. Djoko Santoso. Sementara itu mewakili reviewer, Prof. I Nyoman Sucipta mengatakan terima kasih kepada Universitas Airlangga yang dengan sepenuh hati menyediakan kesediaan untuk menjadi tuan rumah dan menerima tim PKM dari perguruan tinggi lain dengan layanan yang sangat baik. Prof. Nyoman menyebut peserta PKM ini sebagai pejuang PIMNAS, sehingga secara kinerja juga sebagai calon atau kader-kader pemimpin dalam keberlangsungan bangsa dan negara. ”Anda merupakan mahasiswa terpilih yang sudah lolos sampai dengan tahap ini, jadi tinggal selangkah lagi menuju PIMNAS. Tinggal seberapa jauh output aplikasi, publikasi, dan kemungkinan hak patent dari inovasi Anda. Karena sesungguhnya ikhwal publikasi ilmiah ini menjadi harapan kita semua,” kata Prof. Nyoman, Guru Besar Universitas Udayana ini. Pasca pembukaan, ke-134 tim PKM harus melakukan presentasi di hadapan reviewer. Untuk itu panitia, yang dibantu oleh tim Garuda Sakti mahasiswa UNAIR, telah membagi jadwal dan lokasi presentasi kepada peserta, hingga hari Kamis (19/7) ini. (*) Penulis: Bambang Bes'),(235,'Kamis (22/2) petang Singosari Ballroom WTC Surabaya dipadati lebih dari seratus pengunjung berbagai usia. Mayoritas berasal dari Surabaya. Sebagian lainnya dari berbagai kota. Di antaranya, Sidoarjo, Malang, dan Mojokerto. Mereka bukan sedang menanti peluncuran ponsel terbaru, melainkan menghadiri talkshow off-air Hidup Produktif dengan Ginjal Sehat yang biasa mengudara di radio JJFM setiap Kamis pukul 18.00-19.00. Mengusung tema Indahnya Hidup dengan Ginjal Sehat, ahli ginjal dr Djoko Santoso SpPD K-GH PhD memaparkan serba-serbi penyakit ginjal. Penyebab dan kiat mencegah terjadinya gagal ginjal kronik dijelaskannya dengan bahasa yang mudah dicerna. Sehingga, meski kebanyakan peserta talkshow bukan berlatar belakang medis, mereka tetap bisa memahaminya dengan mudah. Usai presentasi oleh dr Djoko, peserta diberikan kesempatan melakukan tanya jawab. Spontan peserta yang rata-rata ingin menambah pengetahuan tentang kesehatan menjaga kesehatan ginjal itu berebut mengacungkan tangan. Ada yang bertanya seputar penyakit ginjal, ada pula yang sekadar berbagi pengalaman menjaga kesehatan tubuh. Tepat pukul 21.00 acara berakhir. Peserta yang kebetulan menderita penyakit ginjal membawa pulang pengetahuan tambahan tentang cara mengatasi atau setidaknya memperlambat gangguan pada ginjalnya. Sedangkan peserta yang masih sehat memperoleh wawasan mengenai kiat menjaga kesehatan plus mendeteksi gangguan awal pada ginjal. (lee) Sumber : https://jjfm.wordpress.com/2008/02/28/ginjal-sehat/'),(236,'Badan Eksekutif Mahasiswa (BEM) Universitas Airlangga Surabaya menggelar mudik gratis ke enam kota. Ratusan sivitas akademika Unair diberangkatkan secara simbolis oleh Prof Djoko Santoso Wakil Rektor I Unair di kampus setempat, Sabtu (9/6/2018).  Prof Djoko saat pemberangkatan mengatakan, enam kota tujuan mudik gratis itu diantaranya Banyuwangi, Trenggalek, Blitar, Ponorogo, Pacitan, dan Sampang. Mudik gratis yang diselenggarakan oleh Unair kali ini bekerja sama dengan Dinas Perhubungan Jawa Timur.\"Dengan mengucap kata bismillah hirrahman nirrahim, mudik gratis diberangkatkan, semoga lancar dan selamat sampai tujuan masing-masing,\" kata dia dilansir dari Antara.Dia mengatakan, kegiatan ini adalah rutin digelar setiap tahun untuk memfasilitasi mahasiswa atau karyawan Unair yang ingin mudik ke kampung halaman.\"Kami menyampaikan ucapan terima kasih kepada Dinas Perhubungan Jawa Timur yang ikut mensukseskan program kerja mahasiswa ini. Selain itu juga terima kasih kepada BEM Unair yang mampu melakukan koordinasi secara baik dengan Dinas Perhubungan,\" kata Guru Besar Fakultas Kedokteran Unair itu.Emmy Retnowati Perwakilan Dinas Perhubungan Jatim selain bekerja sama dengan Unair, pihaknya juga menyediakan program mudik gratis. Ada sebanyak 926 bus yang disediakan dengan rincian sebanyak 560 bus umum dan 366 bus bantuan sponsor dan bantuan kabupaten/kota di Jatim.Selain bus, Dishub Jatim juga menyiapkan 10 buah truk yang digunakan untuk mengangkut 400 sepeda motor milik para pemudik. Untuk mudik menggunakan kapal laut, pihaknya melaksanakan sebanyak 34 pemberangkatan dengan lima tujuan yaitu pulau-pulau kecil di sekitar Madura dan kawasan Jatim lain dengan membawa 134.991 penumpang.\"Karena ini rutin, sehingga kami perlu melakukan penertiban dan pengawasan secara tertib. Tugas kami antara lain meminimalkan kecelakaan lalu lintas, menciptakan kelancaran arus mudik, sehingga harus dilakukan pengawasan dan pengamanan yang seksama,\" kata Emmy.Sementara itu, AKP Mahsum Wakapolsek Mulyorejo Surabaya berpesan kepada para pemudik, dan terutama kepada para awak bus, hendaknya dalam perjalanan mematuhi segala aturan lalulintas. Utamakan keselamatan penumpang, untuk bisa bertemu dengan keluarga dengan kondisi sehat.\"Itu saja pesan saya, yaitu utamakan keselamatan,\" katanya.(ant/tna)  Sumber : http://m.suarasurabaya.net/app/kelanakota/detail/2018/204928-BEM-Unair-Berangkatkan-Bus-Mudik-Gratis-ke-Enam-Kota'),(237,'KBRN, Surabaya : Mudik ke kampung halaman sudah menjadi tradisi masyarakat di Indonesia,  ketika menjelang Lebaran. Banyak dari instansi dan lembaga pendidikan menggelear mudik bareng gratis. Salah satunya Institut Teknologi Sepuluh Nopember (ITS) dan Badan Eksekutif Mahasiswa (BEM) Universitas Airlangga (Unair) Surabaya. Di ITS terdapat sebanyak 13 bus di Taman Alumni ITS siap mengantar para pemudik. BEM Unair menyiapkan delapan bus dan dilepas Prof. Djoko Santoso didampingi Perwakilan Dinas Perhubungan Jatim Emmy Retnowati, SH., MH., Wakapolsek Mulyorejo AKP. Mahsum, dan Ketua BEM KM UNAIR Galuh Teja Sakti.Mahasiswa yang jadi pendaftar pun tak hanya dari ITS, tetapi juga dari kampus-kampus lain di Surabaya. “Saya merasa senang bisa mudik bareng secara gratis ini, merasa terfasilitasi sekali, jadi bisa menghemat ongkos kendaraan,” tutur Indah, mahasiswa Universitas Airlangga yang akan mudik ke Probolinggo, Sabtu (9/6/2018).Hal senada diungkapkan beberapa mahasiswa ITS yang mengikuti mudik bareng ini. “Mudik bareng ini telah saya nantikan dari dulu, karena saya ingin bertemu sama keluarga,\" kata salah satu mahasiswa.Untuk BEM Unair ada delapan rute perjalanan yang akan dilalui bus-bus tersebut, antara lain Kertosono-Trenggalek, Situbondo-Banyuwangi Utara, Karangjati-Ngawi, Malang-Blitar, Jember-Banyuwangi Selatan, Madiun-Ponorogo, Madiun-Magetan, dan Bojonegoro. (Benny/Evie). sumber : http://rri.co.id/post/berita/538048/sorotan_kampus/its_dan_bem_unair_gelar_mudik_gratis.html'),(238,'Ginjal merupakan salah satu organ tubuh yang berfungsi vital. Sayang, masyarakat baru menyadari pentingnya ginjal saat telanjur sakit. Fenomena itulah yang selama ini diamati Prof Dr Djoko Santoso PhD K-GH FINASIM.  DJOKO patut risau. Pakar ginjal itu menyatakan, kondisi kebanyakan pasien yang datang untuk berobat ke rumah sakit tergolong parah. Stadium 4–5. Terminal. Jadi, penyembuhan sulit dilakukan. Berbeda dengan organ lain, ginjal memiliki mekanisme kerja yang cukup kompleks di dalam tubuh. Di antaranya, untuk mengatur tekanan darah dan hemoglobin, mengatur keseimbangan asam basa, serta mengeluarkan racun dari tubuh. Sebagai organ penting, ginjal sering tidak memberikan respons langsung ketika mengalami suatu masalah. Ginjal biasanya menampilkan reaksi ketika fungsinya sudah lemah. ”Kondisi inilah yang membuat pasien ginjal sering terlambat berobat,” katanya. Pria kelahiran 26 April 1961 tersebut menjelaskan, 90 persen orang yang sakit ginjal umumnya tidak memiliki keluhan. Jika ada yang mengeluh, kondisi orang itu dipastikan sudah parah atau gagal ginjal kronis (GGK). Biasanya, sebelum terjadi GGK, penyakit lain menghampiri penderita. Di antaranya, diabetes melitus, hipertensi, dan obesitas. ”Nah, jika ada penyakit tersebut, muaranya pasti berdampak pada ginjal,” ucap Djoko. Di Indonesia, belum ada penelitian secara khusus mengenai jumlah penderita penyakit ginjal. Jika dibandingkan dengan negara lain, jumlah penderita gangguan ginjal di Indonesia cukup tinggi. Di Amerika Serikat, misalnya. Data terbaru menyebutkan, satu di antara sepuluh orang dipastikan menderita penyakit ginjal. Padahal, pelayanan untuk penanganan dan pengaturan pola makan sudah baik. Nah, di Indonesia, dengan penanganan dan pencegahan yang minim, bisa jadi jumlah penderita lebih tinggi. Di Indonesia, satu di antara tujuh orang menderita gangguan ginjal. Ada beberapa pemicu gangguan ginjal, baik ringan, sedang, maupun berat. Di antaranya, pola hidup yang tidak sehat, sering stres, dan kurang istirahat. Untuk pola hidup, kesadaran masyarakat dalam mengonsumsi makanan sehat dan ideal masih minim. Mayoritas orang Indonesia gemar menyantap makanan berkalori tinggi, rendah serat, dan tinggi garam. ”Kalau nggak asin, nggak terasa enak katanya,” ujar Djoko, lantas terkekeh. Doktor jebolan Juntendo University, School of Medicine, Tokyo, Jepang, itu menambahkan, faktor keturunan ikut berperan. Orang tua yang memiliki riwayat penyakit seperti diabetes melitus atau hipertensi akan menurunkan bakatnya kepada anaknya. Untuk mengatasi tingginya angka penderita, satu-satunya cara yang efektif adalah mengetahui gejala penyakit ginjal sejak dini. Djoko tak ingin berpangku tangan. Dia menulis buku berjudul 60 Menit Menuju Ginjal Sehat. Pembaca bisa dengan mudah mengetahui perubahan tubuh yang berkaitan dengan gangguan ginjal. Bahkan, buku karyanya menjadi sumber pembelajaran bagi siswa SD hingga SMA dari Pusat Perbukuan Kementerian Pendidikan Nasional pada 2011. Djoko menyebutkan, pembuatan buku itu berkaitan dengan keprihatinannya melihat kondisi pasien yang serbasusah untuk berobat. Terlebih jika membutuhkan cuci darah dan cangkok ginjal. ”Bayangkan saja, untuk sekali cuci darah, pasien harus bayar sekitar Rp 1 juta. Padahal, untuk cuci darah, satu bulan bisa delapan kali,” tutur suami Herna Nursilarini tersebut. Djoko berharap bukunya mampu menekan risiko terkena penyakit ginjal. Tip ginjal sehat itu, jika dilakukan secara rutin, akan berdampak pada kesehatan tubuh secara menyeluruh. ”Mencegah datangnya penyakit selalu lebih baik daripada mengobati,” tegasnya. (elo/c18/nda)'),(239,'Universitas Airlangga (Unair) Surabaya menerima 1.865 calon mahasiswa dari 29.546 pendaftar melalui jalur Seleksi Nasional Masuk Perguruan Tinggi Negeri (SNMPTN) tahun 2017 yang diumumkan secara nasional, Rabu, 26 April 2017.  Universitas Airlangga. unair.ac.id \"Saya mengucapkan selamat kepada adik-adik mahasiswa yang berhasil diterima di Universitas Airlangga. Universitas Airlangga adalah salah satu perguruan tinggi negeri terbaik di Indonesia,\" tutur Wakil Rektor I Universitas Airlangga Prof Djoko Santoso di kampus setempat, Rabu, 26 April 2017. Djoko mengatakan persaingan dalam memperebutkan kursi di Universitas Airlangga terbilang sangat ketat. Terhitung, tingkat keketatan rata-rata seluruh program studi adalah satu dibanding dua puluh. Artinya, setiap satu kursi di Unair diperebutkan oleh 20 pendaftar. Selain itu, lanjut Djoko, calon mahasiswa baru pada jalur SNMPTN didominasi oleh pendaftar dari Pulau Jawa. Dari 1.865 orang yang berhasil diterima, sebanyak 1.644 orang berasal dari Jawa, sementara 221 lainnya dari luar Jawa. Dari 1.644 orang tersebut, Jawa Timur masih mendominasi dengan angka 1.515 sementara luar Jawa Timur sebanyak 349 orang. Meski didominasi oleh peserta dari Jawa Timur, calon mahasiswa baru Universitas Airlangga berasal dari 35 provinsi di Indonesia. ini artinya, sebaran calon mahasiswa baru Unair meluas ke seluruh provinsi di Indonesia. \"Menariknya, jumlah laki-laki yang diterima sekitar 317, sedangkan perempuan lebih banyak. Yang perempuan mencapai 1.548 orang. Banyak perempuan yang lebih pintar,\" ujar Guru Besar Fakultas Kedokteran Universitas Airlangga tersebut. Djoko menjelaskan, Program Studi S-1 Pendidikan Dokter dan S-1 Manajemen masih menjadi favorit pilihan pendaftar. Sebanyak 1.775 pendaftar memilih S-1 Pendidikan Dokter, sedangkan 2.219 pendaftar memilih S-1 Manajemen. \"Padahal, masing-masing kuotanya SNMPTN adalah 89 kursi (Pendidikan Dokter) dan 101 kursi (Manajemen),\" ucapnya. Djoko mengimbau agar pendaftar yang berhasil diterima di Universitas Airlangga segera melakukan daftar ulang. Proses verifikasi dokumen peserta pendaftaran ulang di Universitas Airlangga  dilaksanakan pada 16 Mei 2017 bersamaan dengan pelaksanaan ujian tertulis SBMPTN 2017. Selain itu, peserta yang lolos, diminta untuk melakukan registrasi mahasiswa baru via jaringan. Terkait informasi registrasi mahasiswa baru, akan segera diperbarui di laman http://ppmb.unair.ac.id. Sementara bagi peserta yang belum dinyatakan lolos mereka disarankan mencoba kembali melalui jalur Seleksi Bersama Masuk Perguruan Tinggi Negeri (SBMPTN) dan jalur Mandiri. \"Bagi yang belum beruntung, silakan mencoba lewat jalur SBMPTN yang sekarang sudah dibuka proses pendaftarannya. Selain itu, jalur Mandiri di Universitas Airlangga juga menggunakan nilai SBMPTN untuk proses seleksi,\" tutur Djoko.'),(240,'SURABAYA (BM) - Sarana dan prasarana Ujian Tulis Berbasis Komputer (UTBK) untuk Seleksi Bersama Masuk Perguruan Tinggi Negeri (SBMPTN) terus disiapkan. Salah satunya dengan menggelar simulasi ujian, Kamis (19/4). Simulasi dilakukan serentak di semua Panitia Lokal (Panlok) pelaksana UTBK se Indonesia.Di Panlok 50 Surabaya, lima perguruan tinggi negeri (PTN) pelaksana UTBK, Universitas Airlangga (Unair), Universitas Negeri Surabaya (Unesa), Universitas Islam Negeri Sunan Ampel (UINSA), Institut Teknologi 10 Nopember (ITS) Surabaya, dan Universitas Pembangunan Nasional (UPN) \"Veteran\" Jatim, serempak menggelar simulasi. Minus Universitas Trunojoyo Madura (UTM) karena belum melaksanakan UTBK. Di Unair, Ketua Panlok 50 Surabaya Prof Djoko Santoso meninjau pelaksanaan simulasi UTBK di gedung Airlangga Medical Education Centre (AMEC) lantai 4 Fakultas Kedokteran (FK) Unair. Terdapat 220 komputer yang akan digunakan untuk UTBK SBMPTN di ruangan tersebut. Namun, hanya 20 komputer yang digunakan simulasi. \"Ada 20 sukarelawan dari mahasiswa setempat yang mencoba UTBK,\" kata Prof Djoko.Dia menjelaskan, Panlok 50 Surabaya menyediakan kuota sebanyak  2.770 komputer. Jumlah itu tersebar di lima PTN. \"Harapannya memang 3.000 komputer, tapi keinginan itu disesuaikan dengan kemampuan PTN,\" ujarnya. Simulasi ini, lanjut dia, merupakan kewajiban sebagai langkah strategis menyiapkan ujian sesungguhnya pada 8 Mei.Menurut dia, UTBK memiliki kompleksitas tersendiri. Bukan hanya menyediakan seperangkat komputer fisik, melainkan juga nonfisik. \"Keduanya harus terjamin hasilnya baik,\" terangnya. Yang terjamin itu seperti aspek keamanan, kinerja, sistem kontrol bila ada masalah, daya dukung lain seperti genset, server, dan lain-lain.Prof Djoko mengungkapkan, dari aspek teknis pelaksanaan UTBK lebih rumit dibanding ujian tulis berbasis cetak (UTBK), sehingga diperlukan simulasi. \"Kenapa lebih rumit, karena 10 hari sebelum hari ujian istrik tidak boleh mati. Ini untuk menjamin proses jaringan internet dan server serta proses pelabelan komputer. Komputer pun harus bersih dari pemakaian selain UTBK,\" ungkapnya.Simulasi UTBK juga dilakukan di ITS. Humas SBMPTN dari ITS Siti Machmudah mengatakan, simulasi diikuti oleh 305 siswa SMA dari beberapa SMAN di Surabaya. Di antaranya SMAN 2, SMAN 5, SMAN 12, SMAN 15, dan SMAN 19. Simulasi dimulai pada pukul 7.30 WIB untuk ujian tes kemampuan dasar (TKD) Saintek, dilanjutkan ujian tes kemampuan potensi akademik (TKPA) dan ujian TKD Soshum masing-masing pada pukul 8.30 dan 9.30 WIB.\"Simulasi dilakukan di beberapa laboratorium komputer pada Departemen Matematika, Statistika, Teknik Mesin, Informatika, Sistem Informasi, Teknik Elektro, Teknik Fisika, Teknik Kimia, Teknik Industri, Teknik Elektro Otomasi, Arsitektur, Teknik Geomatika, Desain Produk, dan Perpustakaan ITS,\" tandasnya.(sdp/udi)');
